INSERT INTO `news` VALUES (1169249,'Hà Nội: Tích cực triển khai GPMB Dự án mở rộng đường Vành đai III','(Xây dựng) - Theo UBND quận Cầu Giấy, hiện nay quận đang chỉ đạo quyết liệt Hội đồng bồi thường hỗ trợ và tái định cư thực hiện điều tra, đo đạc, kiểm đếm đối với các tổ chức, cá nhân thuộc Dự án đầu tư mở rộng đường Vành đai III (đoạn Mai Dịch - cầu Thăng Long).','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/quy-hoach/ha-noi-tich-cuc-trien-khai-gpmb-du-an-mo-rong-duong-vanh-dai-iii.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/072016/01/08/thumbnail/084138baoxaydung_2.jpg',0,'quyhoach',0,'M','2016-10-14 04:48:07','HNTctkGDámrđVđI','xaydung'),(1169250,'Các nguyên tắc hình thành hệ thống không gian xanh đô thị','Thuật ngữ “sinh thái” xuất hiện lần đầu tiên vào năm 1866, từ một nhà động vật học người Đức Ernts Genrih Gekkel. Bản thân thuật ngữ “sinh thái” trong tiếng Hy lạp có nghĩa là “khoa học về môi trường sống”. Thuật ngữ này đã được ông sử dụng khi quan sát môi trường sống, các khu vực sinh sống của các loài động vật.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/quy-hoach/cac-nguyen-tac-hinh-thanh-he-thong-khong-gian-xanh-do-thi.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/072016/01/14/thumbnail/142836baoxaydung_image001.jpg',0,'quyhoach',0,'M','2016-10-14 04:48:07','Cnththtkgxđt','xaydung'),(1169251,'Sẽ lấy ý kiến người dân khi chỉnh trang các tuyến phố xung quanh hồ Hoàn Kiếm','(Xây dựng) - Đó là khẳng định của ông Phạm Tuấn Long, Phó Chủ tịch UBND quận Hoàn Kiếm (Hà Nội) tại buổi giao ban báo chí do Thành ủy Hà Nội tổ chức chiều 5/7.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/quy-hoach/se-lay-y-kien-nguoi-dan-khi-chinh-trang-cac-tuyen-pho-xung-quanh-ho-hoan-kiem.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/072016/05/16/thumbnail/163518baoxaydung_2.jpg',0,'quyhoach',0,'M','2016-10-14 04:48:07','SlýkndkctctpxqhHK','xaydung'),(1169252,'Quảng Bình: Quy hoạch “treo” 10 năm dồn dân vào thế bí','(Xây dựng) – Hệ lụy của một quy hoạch treo suốt hơn 10 năm qua khiến người dân tại xã ven biển Bảo Ninh (TP Đồng Hới, Quảng Bình) bị cấm xây cất nhà cửa trên chính mảnh đất mình đã cầm trong tay giấy chứng nhận quyền sử dụng do UBND TP cấp.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/quy-hoach/quang-binh-quy-hoach-treo-10-nam-don-dan-vao-the-bi.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/072016/07/14/thumbnail/140634baoxaydung_image001.jpg',0,'quyhoach',0,'M','2016-10-14 04:48:07','QBQh“1nddvtb','xaydung'),(1169253,'Hà Nội sẽ dành hơn 33 nghìn ha đất cho giao thông','Tổng diện tích đất dành cho giao thông trên toàn TP Hà Nội sẽ vào khoảng 33.237ha. Đây là con số trong quy hoạch giao thông vận tải Thủ đô Hà Nội đến năm 2030, tầm nhìn đến năm 2050 đã được Thủ tướng Chính phủ phê duyệt.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/quy-hoach/ha-noi-se-danh-hon-33-nghin-ha-dat-cho-giao-thong.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/072016/13/09/thumbnail/091539baoxaydung_8.jpg',0,'quyhoach',0,'M','2016-10-14 04:48:07','HNsdh3nhđcgt','xaydung'),(1169254,'Công bố và bàn giao hồ sơ quy hoạch chi tiết tỷ lệ 1/500 Khu chức năng đô thị Green City','(Xây dựng) - Ngày 15/7, UBND huyện Đan Phượng phối hợp với Sở Quy hoạch-Kiến trúc Hà Nội và Tập đoàn Vingroup-CTCP tổ chức hội nghị công bố và bàn giao hồ sơ quy hoạch chi tiết tỷ lệ 1/500 Khu chức năng đô thị Green City.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/quy-hoach/cong-bo-va-ban-giao-ho-so-quy-hoach-chi-tiet-ty-le-1500-khu-chuc-nang-do-thi-green-city.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/072016/15/21/thumbnail/212034baoxaydung_image001.jpg',0,'quyhoach',0,'M','2016-10-14 04:48:07','Cbvbghsqhcttl1KcnđtGC','xaydung'),(1169255,'Quy hoạch ga đường sắt Bình Triệu (TP.HCM) 33.000 tỷ: Tắc 14 năm vì... vốn quá khủng','Số vốn đầu tư quá lớn, ước tính trên 33.000 tỷ đồng, không biết tìm ở đâu ra, khiến Quy hoạch ga đường sắt Bình Triệu (phường Hiệp Bình Chánh, quận Thủ Đức) sau 14 năm vẫn chỉ là bản vẽ trên giấy.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/quy-hoach/quy-hoach-ga-duong-sat-binh-trieu-tphcm-33000-ty-tac-14-nam-vi-von-qua-khung.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/072016/19/09/thumbnail/091158baoxaydung_2.jpg',0,'quyhoach',0,'M','2016-10-14 04:48:07','QhgđsBT(3tT1nvvqk','xaydung'),(1169256,'Tiếp tục xây dựng tuyến dân cư và nhà ở vùng ngập lũ Đồng bằng sông Cửu Long','(Xây dựng) - Đó là đề xuất được Bộ Xây dựng trình lên Chính phủ nhằm xem xét, quyết định kéo dài việc thực hiện Chương trình xây dựng cụm, tuyến dân cư và nhà ở khu vực thường xuyên ngập lũ Đồng bằng sông Cửu Long trong giai đoạn 2016 - 2020.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/quy-hoach/tiep-tuc-xay-dung-tuyen-dan-cu-va-nha-o-vung-ngap-lu-dong-bang-song-cuu-long.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/072016/19/16/thumbnail/163148baoxaydung_4.jpg',0,'quyhoach',0,'M','2016-10-14 04:48:07','TtxdtdcvnởvnlĐbsCL','xaydung'),(1169257,'Đồ án điều chỉnh quy hoạch chung TP Pleiku','(Xây dựng) - Ngày 19/7, Thứ trưởng Bộ Xây dựng Nguyễn Đình Toàn đã chủ trì cuộc họp nghe báo cáo đồ án điều chỉnh quy hoạch chung xây dựng TP Pleiku, tỉnh Gia Lai.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/quy-hoach/do-an-dieu-chinh-quy-hoach-chung-tp-pleiku.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/072016/19/20/thumbnail/202950baoxaydung_9.jpg',0,'quyhoach',0,'M','2016-10-14 04:48:07','ĐáđcqhcTP','xaydung'),(1169258,'Bài toán khó của Hà Nội, Nhật Bản từng trải qua','Để giải quyết vấn đề ùn tắc giao thông, chỉ có một phương pháp duy nhất là phải phát triển hệ thống giao thông công cộng.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/quy-hoach/bai-toan-kho-cua-ha-noi-nhat-ban-tung-trai-qua.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/nga/072016/22/09/thumbnail/094036baoxaydung_image001.jpg',0,'quyhoach',0,'M','2016-10-14 04:48:07','BtkcHNNBttq','xaydung'),(1169259,'“Hà Nội cần tập trung lập kế hoạch thực hiện cụ thể hóa quy hoạch”','(Xây dựng) - Đó là chỉ đạo của Phó Thủ tướng Trịnh Đình Dũng tại Hội nghị công bố Quy hoạch giao thông vận tải Thủ đô Hà Nội đến năm 2030, tầm nhìn 2050, do UBND TP Hà Nội tổ chức ngày 30/7.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/quy-hoach/ha-noi-can-tap-trung-lap-ke-hoach-thuc-hien-cu-the-hoa-quy-hoach.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/nga/072016/30/16/thumbnail/160746baoxaydung_Giao_thong.jpg',0,'quyhoach',0,'M','2016-10-14 04:48:07','“Ncttlkhthcthqh','xaydung'),(1169260,'5 màu sơn giúp nhà tắm cuốn hút hơn','Một phòng tắm được sơn những màu sơn đẹp, phù hợp chắc hẳn sẽ làm cho bạn cảm thấy thoải mái, dễ chịu hơn khi bước vào căn phòng. Vậy chúng ta nên chọn màu sơn nội thất nào cho phòng tắm để chúng mang lại cảm giác thư giãn cho bạn khi sử dụng? Dưới đây là 5 màu sơn sẽ giúp nhà tắm của bạn trở nên cuốn hút hơn.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/quy-hoach/5-mau-son-giup-nha-tam-cuon-hut-hon.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/nga/072016/30/19/thumbnail/190317baoxaydung_image004.jpg',0,'quyhoach',0,'M','2016-10-14 04:48:07','5msgntchh','xaydung'),(1169261,'Bài 2: Giới chuyên gia nói gì?','(Xây dựng) – Sau 10 năm triển khai, đến năm 2002 mô hình Kiến trúc sư trưởng thành phố đã chính thức được kết thúc “sứ mệnh”. Việc “kết thúc” sứ mệnh của mô hình trong bối cảnh không tổng kết, đánh giá hoạt động đã tạo thành những luồng dư luận hoài nghi về hiệu quả của mô hình này trong suốt một thời gian dài.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/quy-hoach/bai-2-gioi-chuyen-gia-noi-gi.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/082016/08/08/thumbnail/084921baoxaydung_4.jpg',0,'quyhoach',0,'M','2016-10-14 04:48:07','B2Gcgng','xaydung'),(1169262,'Quảng Ninh: Bao giờ KĐT Cao Xanh – Hà Khánh B hết hoang phế?','(Xây dựng) – Mặc dù được khởi công xây dựng từ năm 2003, nhưng hơn một thập kỷ trôi qua, KĐT Cao Xanh – Hà Khánh B (Thành phố Hạ Long - Quảng Ninh) vẫn chưa hoàn thiện để đưa vào sử dụng. Hạ tầng nơi đây cũng đang xuống cấp nghiêm trọng, gây ảnh hưởng lớn đến đời sống cũng như sinh hoạt của vô số hộ dân.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/quy-hoach/quang-ninh-bao-gio-kdt-cao-xanh-ha-khanh-b-het-hoang-phe.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/nga/082016/28/10/thumbnail/103435baoxaydung_anh_1_Cao_Xanh_1.jpg',0,'quyhoach',0,'M','2016-10-14 04:48:07','QNBgKCX–HKBhhp','xaydung'),(1169263,'Hà Nội: Duyệt nhiệm vụ quy hoạch chi tiết hai bên tuyến đường 70','(Xây dựng) - UBND TP Hà Nội vừa có quyết định phê duyệt nhiệm vụ quy hoạch chi tiết hai bên tuyến đường 70 tỷ lệ 1/500 (đoạn từ Hà Đông đến Đại lộ Thăng Long), địa điểm tại phường Tây Mỗ, Đại Mỗ, quận Nam Từ Liêm và phường Vạn Phúc, quận Hà Đông.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/quy-hoach/ha-noi-duyet-nhiem-vu-quy-hoach-chi-tiet-hai-ben-tuyen-duong-70.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/092016/13/14/thumbnail/145725baoxaydung_image001.jpg',0,'quyhoach',0,'M','2016-10-14 04:48:07','HNDnvqhcthbtđ7','xaydung'),(1169264,'Thành phố cảng Liverpool có nguy cơ biến mất','Ô nhiễm, xây dựng tràn lan, khai thác trái phép là những lý do làm ảnh hưởng và sẽ khiến một số di sản thế giới có nguy cơ biến mất, theo lời cảnh báo từ UNESCO.','http://www.baoxaydung.com.vn/news/vn/vat-lieu/thanh-pho-cang-liverpool-co-nguy-co-bien-mat.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/102016/05/09/thumbnail/094158baoxaydung_4.jpg',0,'vatlieu',0,'M','2016-10-14 04:48:08','TpcLcncbm','xaydung'),(1169265,'Bí quyết mua cửa gỗ tự nhiên đẹp mà bền','Với ý định chọn mua mẫu cửa gỗ bảo vệ và trang trí cho căn hộ của mình, hãy tham khảo những lưu ý dưới đây để chọn được sản phẩm chất lượng và phù hợp nhất.','http://www.baoxaydung.com.vn/news/vn/vat-lieu/bi-quyet-mua-cua-go-tu-nhien-dep-ma-ben.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/102016/05/10/thumbnail/105843baoxaydung_image002.jpg',0,'vatlieu',0,'M','2016-10-14 04:48:08','Bqmcgtnđmb','xaydung'),(1169266,'Quảng Nam “tiến thoái lưỡng nan” với Dự án xây dựng nhà máy thép','Người dân tỉnh Quảng Nam lo lắng việc Công ty Trách nhiệm Hữu hạn thép Việt Pháp được chọn địa điểm để xây dựng nhà máy luyện cán thép.','http://www.baoxaydung.com.vn/news/vn/vat-lieu/quang-nam-tien-thoai-luong-nan-voi-du-an-xay-dung-nha-may-thep.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/102016/05/22/thumbnail/220103baoxaydung_2.jpg',0,'vatlieu',0,'M','2016-10-14 04:48:08','QN“tlnvDáxdnmt','xaydung'),(1169267,'Chính thức điều tra chống bán phá giá đối với thép hình H nhập khẩu từ Trung Quốc','(Xây dựng) - Bộ Công Thương vừa có quyết định tiến hành điều tra áp dụng biện pháp chống bán phá giá đối với sản phẩm thép hình H nhập khẩu vào Việt Nam có xuất xứ từ Trung Quốc (bao gồm cả Hồng Kông).','http://www.baoxaydung.com.vn/news/vn/vat-lieu/chinh-thuc-dieu-tra-chong-ban-pha-gia-doi-voi-thep-hinh-h-nhap-khau-tu-trung-quoc.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/vananh/102016/06/15/thumbnail/155602baoxaydung_image001.jpg',0,'vatlieu',0,'M','2016-10-14 04:48:08','CtđtcbpgđvthHnktTQ','xaydung'),(1169268,'Đà Nẵng: Tăng cường giám sát chất lượng gạch không nung','(Xây dựng) - Trước chủ trương của Thủ tướng Chính phủ đến năm 2020 trong các công trình xây dựng, nhất là các công trình xây dựng từ ngân sách của Nhà nước phải sử dụng gạch không nung (GKN),...','http://www.baoxaydung.com.vn/news/vn/vat-lieu/da-nang-tang-cuong-giam-sat-chat-luong-gach-khong-nung.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/vananh/102016/06/20/thumbnail/204726baoxaydung_8.jpg',0,'vatlieu',0,'M','2016-10-14 04:48:08','ĐNTcgsclgkn','xaydung'),(1169269,'Australia khởi xướng điều tra chống phá giá thép mạ hợp kim Việt Nam','Thương vụ Việt Nam tại Australia cho biết, ngày 7/10, Ủy ban Chống bán phá giá (Bộ Công nghiệp, Đổi mới và Khoa học) nước này đã ra quyết định khởi xướng điều tra áp dụng biện pháp chống bán phá giá (AD) và chống trợ cấp (CVD) đối với sản phẩm “thép mạ hợp kim” nhập khẩu từ Ấn Độ, Malaysia và Việt Nam.','http://www.baoxaydung.com.vn/news/vn/vat-lieu/australia-khoi-xuong-dieu-tra-chong-pha-gia-thep-ma-hop-kim-viet-nam.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/administrator/102016/07/13/thumbnail/134407baoxaydung_ttxvn_thepmahopkim161007.jpg',0,'vatlieu',0,'M','2016-10-14 04:48:08','AkxđtcpgtmhkVN','xaydung'),(1169270,'Cách phân biệt các loại đá trong xây dựng','Mặc dù có sự ra đời của hàng loạt vật liệu khác nhau, tuy nhiên trong lĩnh vực xây dựng, đá vẫn là sự lựa chọn số một của con người.','http://www.baoxaydung.com.vn/news/vn/vat-lieu/cach-phan-biet-cac-loai-da-trong-xay-dung.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/102016/07/14/thumbnail/142729baoxaydung_image005.jpg',0,'vatlieu',0,'M','2016-10-14 04:48:08','Cpbclđtxd','xaydung'),(1169271,'Sản phẩm bê tông cốt phi kim của Busadco nhiều ưu việt','(Xây dựng) - Tại hội thảo phát triển đô thị của TP HCM vừa được tổ chức nhằm đánh giá lại toàn bộ hiện trạng về mặt đô thị, trong đó có các vấn đề về kiến trúc, quy hoạch, ứng phó với thiên tai, biến đổi khí hậu… Những vấn đề được nêu tại Hội thảo đã gợi mở những giải pháp lâu dài cho vấn đề ổn định và phát triển của thành phố trong các năm tiếp theo.','http://www.baoxaydung.com.vn/news/vn/vat-lieu/san-pham-be-tong-cot-phi-kim-cua-busadco-nhieu-uu-viet.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/nga/102016/09/17/thumbnail/171335baoxaydung_image002.jpg',0,'vatlieu',0,'M','2016-10-14 04:48:08','SpbtcpkcBnưv','xaydung'),(1169272,'Chưa đầy nửa tháng, thép Việt dính 3 vụ điều tra chống bán phá giá','Liên tiếp trong nửa tháng qua, thép xuất khẩu của Việt Nam, gồm: thép cán nguội, thép các bon chống ăn mòn và thép mạ hợp kim đã bị đề nghị điều tra và nhận quyết định điều tra chống bán phá giá từ Hoa Kỳ và Australia.','http://www.baoxaydung.com.vn/news/vn/vat-lieu/chua-day-nua-thang-thep-viet-dinh-3-vu-dieu-tra-chong-ban-pha-gia.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/102016/11/08/thumbnail/084311baoxaydung_5.jpg',0,'vatlieu',0,'M','2016-10-14 04:48:08','CđnttVd3vđtcbpg','xaydung'),(1169273,'Việt Nam nhập khẩu lượng lớn thép từ Trung Quốc','(Xây dựng) - Theo báo cáo của Hiệp hội Thép Việt Nam (VSA), trong 8 tháng đầu năm, Việt Nam đã nhập khẩu từ Trung Quốc lượng thép thành phẩm lên đến hơn 7,29 triệu tấn, chiếm 59% trong tổng lượng thép nhập khẩu.','http://www.baoxaydung.com.vn/news/vn/vat-lieu/viet-nam-nhap-khau-luong-lon-thep-tu-trung-quoc.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/102016/11/16/thumbnail/160134baoxaydung_3.jpg',0,'vatlieu',0,'M','2016-10-14 04:48:08','VNnkllttTQ','xaydung'),(1169274,'Chọn và sử dụng vật liệu chống thấm hiệu quả','Trước khi bước vào mùa mưa, nhà nhà đều chủ động tìm kiếm giải pháp chống thấm cho ngôi nhà mình. Thị trường vật liệu chống thấm ngày càng đa dạng, các dịch vụ chống thấm ngày càng phát triển, nhưng để chọn được loại vật liệu và giải pháp chống thấm phù hợp, hiệu quả thì không đơn giản.','http://www.baoxaydung.com.vn/news/vn/vat-lieu/chon-va-su-dung-vat-lieu-chong-tham-hieu-qua.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/102016/11/20/thumbnail/20