_image003.jpg',0,'kientruc',0,'M','2016-10-14 04:48:09','Nnngttnbt','xaydung'),(1169285,'Không gian thư giãn sinh thái thân thiện bên bờ biển','(Xây dựng) - Nếu bạn đang tìm kiếm một không gian sinh thái thân thiện mà chỉ cần xây dựng trong một thời gian ngắn, thì Avalon House là một ví dụ điển hình.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/kien-truc/khong-gian-thu-gian-sinh-thai-than-thien-ben-bo-bien.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/092016/29/11/thumbnail/112535baoxaydung_image001.jpg',0,'kientruc',0,'M','2016-10-14 04:48:09','Kgtgstttbbb','xaydung'),(1169286,'Lựa chọn rèm cửa ăn nhập với nội thất sang trọng','(Xây dựng) - Mỗi loại rèm đều có khả năng mang lại tính thẩm mỹ cho căn nhà nếu chủ nhân khéo léo trong cách lựa chọn màu sắc, độ dài và độ dày vừa đủ. Màu sắc ăn nhập với nội thất không chỉ khiến không gian thêm tinh tế mà còn tạo cảm giác rộng và có chiều sâu hơn.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/kien-truc/lua-chon-rem-cua-an-nhap-voi-noi-that-sang-trong.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/092016/29/16/thumbnail/162032baoxaydung_image007.jpg',0,'kientruc',0,'M','2016-10-14 04:48:09','Lcrcănvntst','xaydung'),(1169287,'Nên chọn màu sơn tường hay chọn đồ nội thất trước?','Nên chọn màu sơn tường trước hay chọn đồ nội thất trước? Đây cũng là câu hỏi mà rất nhiều gia chủ băn khoăn khi có nhu cầu trang trí nội thất ngôi nhà.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/kien-truc/nen-chon-mau-son-tuong-hay-chon-do-noi-that-truoc.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/vananh/102016/04/23/thumbnail/235444baoxaydung_image002.jpg',0,'kientruc',0,'M','2016-10-14 04:48:09','Ncmsthcđntt','xaydung'),(1169288,'Cổng chào hai trăm tỷ ở Quảng Ninh','Nằm trên Quốc lộ 18A với vốn đầu tư 198 tỷ đồng, cổng chào tỉnh Quảng Ninh được cho là lớn nhất Việt Nam.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/kien-truc/cong-chao-hai-tram-ty-o-quang-ninh.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/vananh/102016/06/21/thumbnail/213606baoxaydung_image001.jpg',0,'kientruc',0,'M','2016-10-14 04:48:09','CchttởQN','xaydung'),(1169289,'Mở rộng không gian xanh cho ngôi biệt thự xinh đẹp tại Anh','(Xây dựng) - Ngôi biệt thự Victoria xinh đẹp ở Clapton, Anh đã trở nên sinh động và tươi mới hơn sau khi được hãng kiến trúc Scenario Architecture cải tạo lại.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/kien-truc/mo-rong-khong-gian-xanh-cho-ngoi-biet-thu-xinh-dep-tai-anh.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/vananh/102016/09/19/thumbnail/195405baoxaydung_image002.jpg',0,'kientruc',0,'M','2016-10-14 04:48:09','MrkgxcnbtxđtA','xaydung'),(1169290,'Thiết kế phòng ngủ hiện đại và ấm cúng','(Xây dựng) - Nếu bạn đang có ý định làm mới phòng ngủ của mình thì hãy tham khảo những mẫu thiết kế dưới đây. Những ý tưởng thiết kế đơn giản nhưng đem lại hiệu quả cao.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/kien-truc/thiet-ke-phong-ngu-hien-dai-va-am-cung.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/vananh/102016/10/09/thumbnail/094829baoxaydung_image002.jpg',0,'kientruc',0,'M','2016-10-14 04:48:09','Tkpnhđvấc','xaydung'),(1169291,'Căn bếp sang trọng với nội thất gỗ đơn giản','(Xây dựng) – Thay cho những loại chất liệu khác, nội thất toàn đồ gỗ đơn giản chắc chắn sẽ là sự lựa chọn hoàn hảo cho những người yêu thích không gian sang trọng, tinh tế không quá màu mè.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/kien-truc/can-bep-sang-trong-voi-noi-that-go-don-gian.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/vananh/102016/13/16/thumbnail/162714baoxaydung_image001.jpg',0,'kientruc',0,'M','2016-10-14 04:48:09','Cbstvntgđg','xaydung'),(1169292,'Những vị trí cần tránh khi đặt bếp','(Xây dựng) 