h-che-bien-thit-heo-don-gian-ma-mang-lai-vi-ngon-bat-ngo-2016073112064330.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/23/30/A-fd7b0.jpg',0,'nauan_thitheo',0,'M','2016-10-14 04:49:18','Ccbthđgmmlvnbn','nauan'),(1170138,'Vào mùa ngó sen hãy kết hợp để có món thịt heo xào ngon vô cùng!','Thịt heo xào ngó sen với cách chế biến đơn giản mà vẫn giữ được độ giòn ngọt thơm ngon của ngó sen, vị mềm ngọt của thịt. Đây hẳn là món ăn tuyệt vời cho những chị em nào có ý đồ giảm cân đó.','http://m.afamily.vn/vao-mua-ngo-sen-hay-ket-hop-de-co-mon-thit-heo-xao-ngon-vo-cung-20160728012631335.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/23/A-9e7f6.jpg',0,'nauan_thitheo',0,'M','2016-10-14 04:49:18','Vmnshkhđcmthxnvc','nauan'),(1170139,'Mẹ Gạo chia sẻ bí quyết gia truyền làm mắm tép chưng thịt siêu ngon','Mắm tép chưng thịt thơm phức, đậm đà không bị khô như ruốc ăn kèm với cơm trắng nóng hổi thì không gì tuyệt bằng. Cách làm mắm tép chưng thịt cực kỳ đơn giản bạn có thể làm sẵn 1 hũ để dành ăn dần được nhé!','http://m.afamily.vn/me-gao-chia-se-bi-quyet-gia-truyen-lam-mam-tep-chung-thit-sieu-ngon-201608060521974.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/A-6d050.jpg',0,'nauan_thitheo',0,'M','2016-10-14 04:49:18','MGcsbqgtlmtctsn','nauan'),(1170140,'Thêm một cách nấu canh thịt viên ngon không chỗ chê, mê ngay từ miếng đầu tiên','Một tô canh thịt viên giá đỗ sẽ làm cho bữa cơm thêm phần lạ miệng, vừa kích thích vị giác và giải nhiệt hiệu quả!','http://m.afamily.vn/them-mot-cach-nau-canh-thit-vien-ngon-khong-cho-che-me-ngay-tu-mieng-dau-tien-20160808034127124.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/08/A-f9350.jpg',0,'nauan_thitheo',0,'M','2016-10-14 04:49:18','Tmcnctvnkccmntmđt','nauan'),(1170141,'Món ngon cuối tuần: Sườn nướng BBQ','Vào những bữa tiệc cuối tuần, món sườn nướng BBQ hẳn sẽ trở thành “ông hoàng” của bữa tiệc và làm mọi người ai nấy cũng phải hưởng ứng rất nhiệt tình đấy!','http://m.afamily.vn/mon-ngon-cuoi-tuan-suon-nuong-bbq-20160812014827707.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/09/A-c94c1.jpg',0,'nauan_thitheo',0,'M','2016-10-14 04:49:18','MnctSnB','nauan'),(1170142,'Thịt viên sốt cà cho cả nhà ăn không dừng đũa!','Từ thịt và trứng bạn có thể kết hợp để chế biến thành món thịt viên sốt cà chua lạ miệng. Trứng bọc thịt với độ sánh sệt của nước sốt, béo ngậy của thịt sẽ là món ăn khiến nồi cơm của bạn hao dần đấy nhé.','http://m.afamily.vn/thit-vien-sot-ca-cho-ca-nha-an-khong-dung-dua-2016082209382126.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/21/A-35ff1.jpg',0,'nauan_thitheo',0,'M','2016-10-14 04:49:18','Tvscccnăkdđ','nauan'),(1170143,'Cách làm thịt heo chiên mắm ngon cơm bất ngờ','Bạn đã biết cách làm món thịt heo chiên mắm ngon bá cháy, ai ai cũng ghiền chưa? Bữa cơm tối mà có món này ăn cùng cơm nóng thì thật ngon hết ý!','http://m.afamily.vn/cach-lam-thit-heo-chien-mam-ngon-com-bat-ngo-20160901092758888.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/09/A-1ab09.jpg',0,'nauan_thitheo',0,'M','2016-10-14 04:49:18','Clthcmncbn','nauan'),(1170144,'Thử làm thịt chiên làm theo cách này đi, bạn sẽ khiến cả nhà gắp không dừng đũa!','Chỉ với sự thay đổi vài gia vị ướp, bạn đã có món thịt chiên cực kỳ hấp dẫn tưởng là cũ mà lại rất mới đó nhé!','http://m.afamily.vn/thu-lam-thit-chien-lam-theo-cach-nay-di-ban-se-khien-ca-nha-gap-khong-dung-dua-20160827093210520.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/21/Gif2-Thit_heo_chien_-511f1.gif',0,'nauan_thitheo',0,'M','2016-10-14 04:49:18','Tltcltcnđbskcngkdđ','nauan'),(1170145,'Sườn xào khế: Chỉ nghe thôi cũng đủ tứa nước miếng','Từng miếng sườn xào khế thấm đẫm nước sốt sánh mượt trông vô cùng hấp dẫn lại dậy mùi thơm điếc mũi khiến bạn chỉ vừa ngửi thôi cũng đủ… ứa nước miếng rồi đấy!','http://m.afamily.vn/suon-xao-khe-chi-nghe-thoi-cung-du-tua-nuoc-mieng-20160829120136242.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/27/a-bf3c3.jpg',0,'nauan_thitheo',0,'M','2016-10-14 04:49:18','SxkCntcđtnm','nauan'),(1170146,'Thịt kho trứng cút - bạn đã biết làm cách nào để ngon nhất chưa?','Đừng quên nấu nhiều cơm hơn vào hôm nay nhé, vì món thịt kho trứng cút có sức “tấn công” khá là mạnh mẽ đấy!','http://m.afamily.vn/thit-kho-trung-cut-ban-da-biet-lam-cach-nao-de-ngon-nhat-chua-20160918083213812.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/09/15/A-ba5bd.jpg',0,'nauan_thitheo',0,'M','2016-10-14 04:49:18','Tktc-bđblcnđnnc','nauan'),(1170147,'Thêm một cách xào thịt ngon rất hợp cho bữa cơm mùa thu ','Với cách xào thịt ngon này phần thịt sẽ thêm đậm đà, từng miếng từng miếng thơm nức mũi đượm vị chua cay của kim chi rất “bắt” cơm.','http://m.afamily.vn/them-mot-cach-xao-thit-ngon-rat-hop-cho-bua-com-mua-thu-20160923085314664.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/09/20/a-01e0d.jpg',0,'nauan_thitheo',0,'M','2016-10-14 04:49:18','Tmcxtnrhcbcmt','nauan'),(1170148,'Mẹ Liên Ròm chia sẻ cách làm giò lụa chắc chắn thành công cực đơn giản','Ròm xin bày cách cho các bạn bận rộn vẫn làm giò lụa cực chuẩn. Đây cũng là cách Ròm làm từ khi Ròm đi làm bận rộn không còn ở nhà cả ngày để làm giò lụa như xưa.','http://m.afamily.vn/me-lien-rom-chia-se-cach-lam-gio-lua-chac-chan-thanh-cong-cuc-don-gian-20161004120212262.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/10/A-23747.jpg',0,'nauan_thitheo',0,'M','2016-10-14 04:49:18','MLRcsclglcctccđg','nauan'),(1170149,'Củ cải nhồi thịt thanh nhẹ mà đủ chất','Hãy chuẩn bị món củ cải nhồi thịt ngon mát này cho bữa cơm gia đình thêm phần hấp dẫn bạn nhé!','http://m.afamily.vn/cu-cai-nhoi-thit-thanh-nhe-ma-du-chat-20160708092654257.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/06/A-2ffae.jpg',0,'nauan_thitheo',0,'M','2016-10-14 04:49:18','Ccnttnmđc','nauan'),(1170150,'Mát trời không thể bỏ qua món thịt kho măng đậm đà dân dã','Món thịt kho măng là món ăn bình dị mà ngon đến lạ kì. Thịt kho ăn không ngấy chút nào nhờ vị thanh mát của măng tươi giòn giòn, cân bằng cái béo ngậy của thịt ba chỉ.','http://m.afamily.vn/mat-troi-khong-the-bo-qua-mon-thit-kho-mang-dam-da-dan-da-2016092001350324.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/09/20/A-f99dd.jpg',0,'nauan_thitheo',0,'M','2016-10-14 04:49:18','Mtktbqmtkmđđdd','nauan'),(1170151,'Mách các mẹ cách làm ruốc bông như hàng mà an toàn tuyệt đối ','Chỉ với một chút biến tấu nhỏ trong cách làm ruốc, bạn sẽ có món ruốc heo thơm phức, bông nhẹ như ngoài hàng mà đảm bảo vệ sinh đấy!','http://m.afamily.vn/mach-cac-me-cach-lam-ruoc-bong-nhu-hang-ma-an-toan-tuyet-doi-201610041122615.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/10/A-58ba0.jpg',0,'nauan_thitheo',0,'M','2016-10-14 04:49:18','Mcmclrbnhmattđ','nauan'),(1170152,'Đậu phụ sốt thịt bằm giản dị mà ngon cơm','Với cách làm đơn giản, chỉ cần chưa đầy 15 phút từ chuẩn bị đến nấu nướng bạn đã có ngay món đậu phụ sốt thịt bằm ngon tuyệt.','http://m.afamily.vn/dau-phu-sot-thit-bam-gian-di-ma-ngon-com-20160918082315812.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/09/15/a-0eae1.jpg',0,'nauan_thitheo',0,'M','2016-10-14 04:49:18','Đpstbgdmnc','nauan'),(1170153,'Công thức làm thịt heo quay giòn bì \"bất khả chiến bại\" mẹ nào cũng làm thành công!','Món thịt heo quay giòn bì này mà chấm cùng nước mắm tỏi ớt, ăn kèm với dưa chua và cơm nóng thì ngon không còn gì để bàn cãi!','http://m.afamily.vn/cong-thuc-lam-thit-heo-quay-gion-bi-bat-kha-chien-bai-me-nao-cung-lam-thanh-cong-2016101007228253.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/10/8/A-6deb1.jpg',0,'nauan_thitheo',0,'M','2016-10-14 04:49:18','Ctlthqgb\"kcbmncltc','nauan'),(1170154,'Để có món thịt chiên mềm ngon thơm phức, bạn không thể bỏ qua bài viết này','Món thịt chiên kiểu này mềm thật mềm, thơm thật thơm không hề khô lại không ngấy mỡ, cực kỳ phù hợp cho bữa cơm chiều hoặc cho những ai đang muốn thực hiện chế độ lowcarb.','http://m.afamily.vn/de-co-mon-thit-chien-mem-ngon-thom-phuc-ban-khong-the-bo-qua-bai-viet-nay-2016101101053604.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/10/8/A-aab6f.jpg',0,'nauan_thitheo',0,'M','2016-10-14 04:49:18','Đcmtcmntpbktbqbvn','nauan'),(1170155,'Cuối tuần làm chân gà ngâm sả tắc nhâm nhi nào!','Chân gà ngâm sả tắc giòn giòn với vị chua ngọt vừa phải rất phù hợp để làm món khai vị hoặc làm món nhậu cho ông xã thì thật tuyệt đấy!','http://m.afamily.vn/cuoi-tuan-lam-chan-ga-ngam-sa-tac-nham-nhi-nao-2016072001015060.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/12/A-73214.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Ctlcgnstnnn','nauan'),(1170156,'Gà kho đậm đà hao cơm mời cả nhà ăn tối','Món gà kho táo tàu với rượu nếp có hương vị nồng đậm quyện chặt vào từng thớ thịt dai ngon, ngọt thịt sẽ khiến bất kì ai thưởng thức cũng phải mê mẩn ngất ngây!','http://m.afamily.vn/ga-kho-dam-da-hao-com-moi-ca-nha-an-toi-20160714113824286.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/12/A-dfc8a.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Gkđđhcmcnăt','nauan'),(1170157,'Bữa trưa mà ăn cơm cuộn kiểu này thì chẳng bao giờ sợ béo','Những ngày nắng hanh hao dễ khiến cả người lớn và trẻ nhỏ cảm thấy biếng ăn hơn và muốn đổi món. Bạn hãy thử làm món cơm cuộn lạ miệng này nhé, hẳn đây sẽ là một gợi ý hay ho đấy!','http://m.afamily.vn/bua-trua-ma-an-com-cuon-kieu-nay-thi-chang-bao-gio-so-beo-20160715120919336.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/12/A-807d9.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Btmăcckntcbgsb','nauan'),(1170158,'Cánh gà chiên mật ong cho cả nhà tấm tắc','Nóng trời bạn hãy làm món cánh gà chiên mật ong cho ông xã nhắm bia nhé, đảm bảo ông xã sẽ rất ngạc nhiên vì tài nấu nướng của bà nội trợ nhà mình đấy!','http://m.afamily.vn/canh-ga-chien-mat-ong-cho-ca-nha-tam-tac-20160710102145202.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/06/A-e7c5d.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Cgcmoccntt','nauan'),(1170159,'Thêm một cách làm bánh mì kẹp siêu ngon cho bữa sáng','Bánh mì kẹp thịt gà rang sả với vỏ ngoài giòn rụm nhưng ruột bên trong lại xốp mềm, còn nhân bánh vừa đậm đà lại vừa cay nồng và thơm nức vị sả, quyện thêm vị chua giòn của đồ chua giúp bạn đánh bay cảm giác ngán ngấy.','http://m.afamily.vn/them-mot-cach-lam-banh-mi-kep-sieu-ngon-cho-bua-sang-20160723094126364.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/12/a-b6fc6.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Tmclbmksncbs','nauan'),(1170160,'Thử ngay món chân gà trộn chua cay bạn sẽ mê ngay tức thì!','Da gà giòn sần sật, đượm thơm mùi chanh tươi, kèm thêm các loại rau chua ngọt hài hòa khiến bạn cảm thấy không khỏi thích thú. Đó cũng chính là lý do khiến món chân gà trộn chua cay kiểu Thái trở thành món khoái khẩu của nhiều tín đồ ẩm thực.','http://m.afamily.vn/thu-ngay-mon-chan-ga-tron-chua-cay-ban-se-me-ngay-tuc-thi-2016073109521323.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/23/30/a-4188b.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Tnmcgtccbsmntt','nauan'),(1170161,'Dù có vụng đến cỡ nào thì bạn cũng có thể làm được 2 món gà trộn siêu ngon này đấy!','Với 2 món gà trộn sau đây bạn sẽ có thêm một món ngon bổ sung vào thực đơn của gia đình mình đấy!','http://m.afamily.vn/du-co-vung-den-co-nao-thi-ban-cung-co-the-lam-duoc-2-mon-ga-tron-sieu-ngon-nay-day-20160802100733476.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/a-09fa8.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Dcvđcntbcctlđ2mgtsnnđ','nauan'),(1170162,'Cánh gà chiên tỏi: Món ngon cho bữa tối \"bay cơm\"!','Có khá nhiều món ăn được chế biến với cánh gà, trong đó có rất nhiều cách chế biến món cánh gà chiên. Tuy nhiên với món cánh gà chiên tỏi này, bạn hãy thử đổi vị cho bữa cơm gia đình mình một hương vị có vẻ rất Tây này nhé.','http://m.afamily.vn/canh-ga-chien-toi-mon-ngon-cho-bua-toi-bay-com-2016080411179283.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/A-93dde.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','CgctMncbt\"c','nauan'),(1170163,'Mì gà trộn cho bữa trưa văn phòng gọn nhẹ mà vẫn đủ chất','Mì gà trộn có vị mặn ngọt chua cay đủ đầy, ăn kèm thêm rau củ thái sợi ngọt giòn sẽ là bữa trưa văn phòng tuyệt vời vào ngày hè nóng nực.','http://m.afamily.vn/mi-ga-tron-cho-bua-trua-van-phong-gon-nhe-ma-van-du-chat-20160808043559107.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/08/A-307fc.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Mgtcbtvpgnmvđc','nauan'),(1170164,'Gà hấp muối - Làm theo cách này để món ăn ngon nhất','Gà hấp muối đơn giản, mộc mạc nhưng cũng chính nhờ vậy mà gà giữ nguyên được trọn vị đặc trưng và hơn hết càng đậm đà, thơm ngon.','http://m.afamily.vn/ga-hap-muoi-lam-theo-cach-nay-de-mon-an-ngon-nhat-20160808055857855.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/08/A-b579a.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Ghm-Ltcnđmănn','nauan'),(1170165,'Cánh gà chiên chanh sả ăn không nhanh là hết veo','Cánh gà chiên chanh sả có sức hút siêu hấp dẫn ngay từ khi bạn đang chiên, thứ mùi thơm của thịt gà cháy xém quyện cùng hương sả khiến bạn háo hức muốn nhón thử ngay một miếng!','http://m.afamily.vn/canh-ga-chien-chanh-sa-an-khong-nhanh-la-het-veo-20160802100425760.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/a-e9d1b.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Cgccsăknlhv','nauan'),(1170166,'Mách các mẹ cách làm gỏi gà thập cẩm ngon hết cỡ','Món gỏi gà thập cẩm có thể được chọn làm món khai vị cho các bữa tiệc gia đình hoặc là món nộm ăn kèm cho bữa cơm thêm phần đầm ấm!','http://m.afamily.vn/mach-cac-me-cach-lam-goi-ga-thap-cam-ngon-het-co-20160809025218954.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/08/A-6c0bf.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Mcmclggtcnhc','nauan'),(1170167,'Gà cuộn rau củ đẹp mắt ngon miệng cho bữa tối','Món gà cuộn rau củ với vị ngọt của rau củ hòa quyện trong vị đậm đà của thịt gà và đặc biệt là lớp vỏ giòn giòn vàng ruộm ắt hẳn sẽ khiến cả nhà không khỏi tấm tắc.','http://m.afamily.vn/ga-cuon-rau-cu-dep-mat-ngon-mieng-cho-bua-toi-20160810114759986.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/09/a-99e8b.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Gcrcđmnmcbt','nauan'),(1170168,'Tự tay làm cơm kẹp vừa đẹp vừa ngon cho bữa trưa','Cơm kẹp burger gà ngon tuyệt có thể là một phần cơm trưa văn phòng tròn vị, hay chỉ đơn giản là một gợi ý giúp bạn đổi mới bữa cơm truyền thống.','http://m.afamily.vn/tu-tay-lam-com-kep-vua-dep-vua-ngon-cho-bua-trua-20160822091431923.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/21/a-727eb.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Ttlckvđvncbt','nauan'),(1170169,'Bữa tối ngon bất ngờ với món gà giòn cay ấn tượng','Gà giòn cay thơm ngon tới mức bạn phải ứa nước miếng cho mà xem! Miếng gà nướng vàng rộm quyến rũ khiến bạn khó lòng cưỡng lại mà muốn nhón thử ngay một miếng.','http://m.afamily.vn/bua-toi-ngon-bat-ngo-voi-mon-ga-gion-cay-an-tuong-2016082309145219.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/21/a-73617.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Btnbnvmggcất','nauan'),(1170170,'Mát trời ăn gà viên chiên cay cực đưa cơm các mẹ nhé!','Gà viên chiên cay có lớp vỏ giòn nhẹ, bên trong thịt mềm, nóng hổi với nước sốt cay quyện sánh đậm đà, xen lẫn với đậu phộng rang bùi bùi ăn ngon hết chê!','http://m.afamily.vn/mat-troi-an-ga-vien-chien-cay-cuc-dua-com-cac-me-nhe-2016081202315264.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/09/A-c9148.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Mtăgvcccđccmn','nauan'),(1170171,'Món gà kho tiêu sẽ ngon khó cưỡng nếu bạn làm theo cách này','Chỉ với vài bước đơn giản, món gà kho tiêu cay nồng thật đậm đà đã sẵn sàng phục vụ cho bữa cơm nóng hổi ngày hôm nay.','http://m.afamily.vn/mon-ga-kho-tieu-se-ngon-kho-cuong-neu-ban-lam-theo-cach-nay-2016090803592058.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/09/07/A-a6f0d.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Mgktsnkcnbltcn','nauan'),(1170172,'Gà sốt chua ngọt ngon cơm cho cả nhà tấm tắc','Gà sốt chua ngọt ăn rất lạ miệng, thịt gà mềm thơm, thỉnh thoảng điểm xuyết với những miếng táo giòn giòn, chua dịu và mè rang thơm phức, đã ăn là mê!','http://m.afamily.vn/ga-sot-chua-ngot-ngon-com-cho-ca-nha-tam-tac-2016091009111339.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/09/07/A-cc485.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Gscnncccntt','nauan'),(1170173,'Không cần lò nướng vẫn làm được cánh gà nướng siêu hấp dẫn','Không cần dùng đến lò nướng, bạn vẫn có thể món cánh gà nướng chảo với thành phẩm vàng ươm đẹp mắt và hương vị đậm đà khó quên!','http://m.afamily.vn/khong-can-lo-nuong-van-lam-duoc-canh-ga-nuong-sieu-hap-dan-20160918042219271.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/09/15/A-d38de.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Kclnvlđcgnshd','nauan'),(1170174,'Cuối tuần bồi bổ cả nhà với món gà hầm thuốc bắc thơm nức mũi','Gà hầm thuốc bắc là thích hợp hơn cả vào những ngày giao mùa, hay khi trời chuyển lạnh.','http://m.afamily.vn/cuoi-tuan-boi-bo-ca-nha-voi-mon-ga-ham-thuoc-bac-thom-nuc-mui-20161006032254967.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/10/A-8ad35.jpg',0,'nauan_thitga',0,'M','2016-10-14 04:49:20','Ctbbcnvmghtbtnm','nauan'),(1170175,'Khoai môn Lệ Phố nướng: Món ngon giòn thơm khó chối từ','Khoai môn Lệ Phố là món ăn vặt quen thuộc với người Hà Nội, bánh thường được chế biến bằng cách chiên. Nhưng hôm nay bạn hãy thử làm khoai môn Lệ Phố nướng này nhé.','http://m.afamily.vn/khoai-mon-le-pho-nuong-mon-ngon-gion-thom-kho-choi-tu-20160502032919106.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/05/A-0ca67.jpg',0,'raucu',0,'M','2016-10-14 04:49:23','KmLPnMngtkct','nauan'),(1170176,'Làm chè khoai lang dẻo: Món chè đang được chị em yêu thích','Món chè khoai lang dẻo được chị em truyền tay nhau công thức là một món ăn đầy sáng tạo. Miếng khoai lang bùi bùi dai dai kết hợp với nước cốt dừa béo ngậy hấp dẫn cực kỳ.','http://m.afamily.vn/lam-che-khoai-lang-deo-mon-che-dang-duoc-chi-em-yeu-thich-20160505111451148.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/05/A-6b960.jpg',0,'raucu',0,'M','2016-10-14 04:49:23','LckldMcđđceyt','nauan'),(1170177,'Đậm đà đưa cơm với món bầu nhồi thịt rim mặn','Bầu nhồi thịt rim mặn vẫn giữ được độ tươi giòn giòn của miếng bầu đậm đà phần thịt nhồi sẽ giúp cả nhà đánh bay nồi cơm cái vèo ngay.','http://m.afamily.vn/dam-da-dua-com-voi-mon-bau-nhoi-thit-rim-man-20160518013840483.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/05/A-e0c8c.jpg',0,'raucu',0,'M','2016-10-14 04:49:23','Đđđcvmbntrm','nauan'),(1170178,'2 món ngon không dầu mỡ cho bữa cơm ngày hè thanh mát','Những món ngon không dầu mỡ thanh nhẹ giải ngấy cho thực đơn hè ắt hẳn sẽ làm hài lòng các thành viên trong gia đình với cách làm đơn giản sau đây!','http://m.afamily.vn/2-mon-ngon-khong-dau-mo-cho-bua-com-ngay-he-thanh-mat-20160607083018597.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/06/A-bda36.jpg',0,'raucu',0,'M','2016-10-14 04:49:23','2mnkdmcbcnhtm','nauan'),(1170179,'15 phút cho bữa sáng ngon lành với món bánh rau củ chiên','Hãy thử ngay cách làm món bánh rau củ chiên này nhé, bạn sẽ rất ngạc nhiên vì món bánh có phần nhân là đủ loại rau củ nóng hổi nhưng ăn vào thì “giòn rùm rụm” ngất ngây luôn đấy!','http://m.afamily.vn/15-phut-cho-bua-sang-ngon-lanh-voi-mon-banh-rau-cu-chien-2016053008244222.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/05/A-d75a9.jpg',0,'raucu',0,'M','2016-10-14 04:49:23','1pcbsnlvmbrcc','nauan'),(1170180,'Tham khảo thực đơn cơm tối ngon lành nhà mẹ Su chỉ với hơn 60,000đ','Với 4 món chính và 1 món tráng miệng, thực đơn tươm tất này hẳn sẽ làm hài lòng các thành viên trong gia đình bạn!','http://m.afamily.vn/tham-khao-thuc-don-com-toi-ngon-lanh-nha-me-su-chi-voi-hon-60000d-20160614065429280.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/06/A-686b0.png',0,'raucu',0,'M','2016-10-14 04:49:23','TktđctnlnmScvh6','nauan'),(1170181,'Những cách bày rau củ trên đĩa siêu đơn giản mà đẹp mắt','Những món rau luộc luôn được mọi người ưa chuộng vào mùa hè. Làm thế nào để bày rau củ luộc đẹp mắt? Cùng tham khảo những gợi ý sau đây nhé!','http://m.afamily.vn/nhung-cach-bay-rau-cu-tren-dia-sieu-don-gian-ma-dep-mat-2016061610251500.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/06/A-1b545.jpg',0,'raucu',0,'M','2016-10-14 04:49:23','Ncbrctđsđgmđm','nauan'),(1170182,'Ngày nóng, đãi miệng thỏa thuê với dưa chuột cuốn rau củ','Ngày nóng, bạn có thể đãi miệng thỏa thuê với dưa chuột cuốn rau củ. Món ăn thanh mát với sự hiện diện của dưa chuột, cà rốt và nấm giòn ngọt, lại thêm trứng và thịt nên đảm bảo đủ chất.','http://m.afamily.vn/ngay-nong-dai-mieng-thoa-thue-voi-dua-chuot-cuon-rau-cu-2016061903484619.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/06/dua-chuot/a-a28b1.jpg',0,'raucu',0,'M','2016-10-14 04:49:23','Nnđmttvdccrc','nauan'),(1170183,'2 món ngon từ đậu đũa đơn giản cực dễ làm ','Cùng biến tấu cho món đậu đũa thường ngày trở nên thơm ngon và hấp dẫn hơn với 2 cách đơn giản sau đây!','http://m.afamily.vn/2-mon-ngon-tu-dau-dua-don-gian-cuc-de-lam-20160615054117906.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/06/A-4bcef.jpg',0,'raucu',0,'M','2016-10-14 04:49:23','2mntđđđgcdl','nauan'),(1170184,'Thêm một món cuốn siêu hấp dẫn cho nàng giảm cân!','Món cuốn từ xoài và rau diếp không chỉ đẹp mắt bởi nhiều màu sắc tươi tắn, món ăn nhẹ bụng, dễ tiêu này còn giúp bạn ăn ngon hơn trong những ngày nắng nóng này.','http://m.afamily.vn/them-mot-mon-cuon-sieu-hap-dan-cho-nang-giam-can-2016062406120808.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/06/dua-chuot/A-3ad17.jpg',0,'raucu',0,'M','2016-10-14 04:49:23','Tmmcshdcngc','nauan'),(1170185,'Mách bạn 2 cách chế biến món mướp ngọt ngon','Vị ngon ngọt từ mướp kết hợp với nấm, đậu, thịt bò tạo nên hai món ăn đầy dinh dưỡng cho cả nhà cùng thưởng thức!','http://m.afamily.vn/mach-ban-2-cach-che-bien-mon-muop-ngot-ngon-201606140656352.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/06/A-11a98.JPG',0,'raucu',0,'M','2016-10-14 04:49:23','Mb2ccbmmnn','nauan'),(1170186,'Khoai tây chiên theo cách này ăn ngon hết sảy!','Đây là cách làm đơn giản, bạn cũng có thể tự làm ở nhà với 1 chút thay đổi biến tấu khẩu vị cho món khoai tây chiên mới này sẽ làm bạn ngạc nhiên đó!','http://m.afamily.vn/khoai-tay-chien-theo-cach-nay-an-ngon-het-say-20160626124230853.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/06/01/A-51aa6.jpg',0,'raucu',0,'M','2016-10-14 04:49:23','Ktctcnănhs','nauan'),(1170187,'15 phút tốc hành cho bạn 2 món ngon từ đậu bắp bổ dưỡng mà đẹp mắt','Chỉ 15 phút tốc hành sẽ cho bạn 2 món ngon từ đậu bắp bổ dưỡng mà đẹp mắt rồi đấy! Hãy thử lựa chọn món ăn phù hợp với khẩu vị của gia đình nhé!','http://m.afamily.vn/15-phut-toc-hanh-cho-ban-2-mon-ngon-tu-dau-bap-bo-duong-ma-dep-mat-2016072801091108.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/23/a-8aaae.jpg',0,'raucu',0,'M','2016-10-14 04:49:23','1pthcb2mntđbbdmđm','nauan'),(1170188,'Bữa cơm chiều đơn giản mà ngon với món đậu phụ sốt rau củ','Đậu phụ sốt rau củ với phần nước sốt sánh mịn hoà quyện vị béo ngậy của đậu phụ, vị bùi thơm của lạc rang cùng với sắc vàng bắt mắt, món ăn sẽ trở thành điểm nhấn hấp dẫn trên bàn ăn của gia đình bạn.','http://m.afamily.vn/bua-com-chieu-don-gian-ma-ngon-voi-mon-dau-phu-sot-rau-cu-20160730114541959.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/23/30/A-01d37.jpg',0,'raucu',0,'M','2016-10-14 04:49:23','Bccđgmnvmđpsrc','nauan'),(1170189,'Để giảm cân mà vẫn được ăn ngon miệng, bạn hãy thử ngay món dim sum rau củ nhé!','Bánh dim sum rau củ với phần vỏ được biến tấu thêm cách tạo màu an toàn bằng rau chân vịt. Nhờ vậy bánh không những có màu trong xanh đẹp mắt mà lại bổ sung chất xơ, tăng cường dinh dưỡng mà chẳng lo tăng cân nữa đấy, thật là một công đôi việc!','http://m.afamily.vn/de-giam-can-ma-van-duoc-an-ngon-mieng-ban-hay-thu-ngay-mon-dim-sum-rau-cu-nhe-2016062410374299.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/06/mau/A-1aecb.jpg',0,'raucu',0,'M','2016-10-14 04:49:23','Đgcmvđănmbhtnmdsrcn','nauan'),(1170190,'Hai món ăn kiêng ngon không dầu mỡ cho chị em dáng đẹp eo thon','Với hai món ăn kiêng ngon là bắp cải cuộn rau củ và salad dưa leo nha đam, bạn sẽ chẳng lo thực đơn ăn kiêng của mình trở nên nhàm chán nữa đâu nhé!','http://m.afamily.vn/hai-mon-an-kieng-ngon-khong-dau-mo-cho-chi-em-dang-dep-eo-thon-20160810100322427.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/09/A-ccfa6.jpg',0,'raucu',0,'M','2016-10-14 04:49:23','Hmăknkdmccedđet','nauan'),(1170191,'Khoai môn chiên giòn: Món ăn ngon rất dễ \"nghiền\"','Miếng khoai môn chiên giòn tan, đượm chút bùi béo của vừng chiên và nhấn nhá chút cay thơm nhè nhẹ của tiêu sẽ là món ăn vặt đã miệng mà bạn sẽ khó lòng chối từ.','http://m.afamily.vn/khoai-mon-chien-gion-mon-an-ngon-rat-de-nghien-20160817042616408.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/09/17/a-f5e18.jpg',0,'raucu',0,'M','2016-10-14 04:49:23','KmcgMănrd\"','nauan'),(1170192,'Salad rau củ làm kiểu này thì không ai có thể chối từ','Với món salad rau củ đơn giản này hẳn sẽ đem đến cho bữa ăn gia đình bạn một món ăn có vị chua thanh mát mà không hề có cảm giác ngán ngấy chút nào.','http://m.afamily.vn/salad-rau-cu-lam-kieu-nay-thi-khong-ai-co-the-choi-tu-20160615064853557.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/06/A-820e8.jpg',0,'raucu',0,'M','2016-10-14 04:49:23','Srclkntkactct','nauan'),(1170193,'Thêm một món salad siêu ngon cho các nàng cần giữ dáng','Món salad rau củ này cực kì tốt cho những ai muốn giảm cân, giữ dáng đấy nhé! Vừa nhanh gọn dễ làm, vừa ngon miệng, bắt mắt ai cũng thích ăn!','http://m.afamily.vn/them-mot-mon-salad-sieu-ngon-cho-cac-nang-can-giu-dang-201610080949635.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/10/8/A-e5bab.jpg',0,'raucu',0,'M','2016-10-14 04:49:23','Tmmssnccncgd','nauan'),(1170194,'Bổ sung ngay món canh đậu phụ mát lành vào thực đơn cơm tối mùa nóng','Không chỉ mát lành và ngon miệng, món canh đậu phụ nấu tôm còn là món ăn siêu dinh dưỡng nhờ cung cấp hàm lượng lớn canxi cho cơ thể.','http://m.afamily.vn/bo-sung-ngay-mon-canh-dau-phu-mat-lanh-vao-thuc-don-com-toi-mua-nong-2016061703493581.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/06/A-feae5.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','Bsnmcđpmlvtđctmn','nauan'),(1170195,'Đây là cách làm tôm rim đảm bảo mới ngửi đã chảy nước miếng!','Bắt tay vào làm tôm rim theo công thức này bạn sẽ cảm nhận được vị thơm béo của nước cốt dừa, đậm đà ngọt ngon của tôm. Giữ lại vỏ tôm giòn giòn kèm đĩa rau luộc cũng \"hao\" cơm trắng lắm đấy.','http://m.afamily.vn/day-la-cach-lam-tom-rim-dam-bao-moi-ngui-da-chay-nuoc-mieng-2016062608439930.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/06/mau/A-4710c.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','Đlcltrđbmnđcnm','nauan'),(1170196,'Tôm rim dưa lưới vừa lạ vừa ngon ai cũng phải mê','Món tôm rim dưa lưới có vị ngọt, chắc thịt của tôm kết hợp với cái thanh mát khác lạ của dưa lưới, quyện đều trong hỗn hợp gia vị thấm thía, đậm đà, ăn cùng cơm nóng là ngon hết ý!','http://m.afamily.vn/tom-rim-dua-luoi-vua-la-vua-ngon-ai-cung-phai-me-20160626115430112.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/06/mau/A-55edd.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','Trdlvlvnacpm','nauan'),(1170197,'Món ngon cuối tuần: Tôm hấp sả chanh','Tôm hấp sả chanh sẽ giữ trọn được vị ngon ngọt của tôm cùng hương sả chanh thơm phức, giản dị mà ngon lành quá chừng!','http://m.afamily.vn/mon-ngon-cuoi-tuan-tom-hap-sa-chanh-20160710110729254.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/06/A-3949b.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','MnctThsc','nauan'),(1170198,'Mùa hè oi nóng nhất định phải nấu 2 món canh ngon ngọt này!','Ngày hè oi ả, những món canh ngọt mát hoặc có thành phần bổ dưỡng thanh nhiệt cho cơ thể luôn được ưu tiên hàng đầu. Hãy vào bếp nấu 2 món canh ngon ngọt cho bữa cơm tối nhé!','http://m.afamily.vn/mua-he-oi-nong-nhat-dinh-phai-nau-2-mon-canh-ngon-ngot-nay-201607040931873.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/A-4bdac.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','Mhonnđpn2mcnnn','nauan'),(1170199,'Cuối tuần làm chả tôm phô mai ngon lạ đãi cả nhà','Món chả tôm phô mai với phần vỏ vàng ruộm bắt mắt, ăn vào thì lại càng bất ngờ hơn khi chả dai mịn, nóng hổi và béo ngậy với nhân phô mai tràn ra ngon mê mẩn!','http://m.afamily.vn/cuoi-tuan-lam-cha-tom-pho-mai-ngon-la-dai-ca-nha-2016071010132757.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/06/A-52613.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','Ctlctpmnlđcn','nauan'),(1170200,'Muốn giảm cân nhanh đừng bỏ qua món salad cực ngon này','Món salad tôm dứa còn có thêm điểm cộng là tuy giàu dinh dưỡng nhưng lại hỗ trợ tích cực cho quá trình giảm cân của bạn, khiến bạn có thể ăn thỏa thuê mà không lo dư thừa calo đâu nhé!','http://m.afamily.vn/muon-giam-can-nhanh-dung-bo-qua-mon-salad-cuc-ngon-nay-20160728010549899.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/23/a-bb7ea.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','Mgcnđbqmscnn','nauan'),(1170201,'Tôm bọc giấy bạc – món ngon hoàn hảo cho buổi picnic cuối tuần','Tôm bọc giấy bạc nướng là món ăn rất thích hợp cho dịp cuối tuần vì vừa đầy đủ dưỡng chất lại vừa chế biến nhanh gọn.','http://m.afamily.vn/tom-boc-giay-bac-mon-ngon-hoan-hao-cho-buoi-picnic-cuoi-tuan-20160724104929865.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/23/A-4168d.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','Tbgb–mnhhcbpct','nauan'),(1170202,'Xuýt xoa với tôm xiên nướng chanh tỏi thơm ngon điếc mũi','Với nước sốt chanh tỏi ngon miệng, lại được rắc thêm rau mùi tây khiến món tôm xiên nướng càng thêm kích thích khẩu vị.','http://m.afamily.vn/xuyt-xoa-voi-tom-xien-nuong-chanh-toi-thom-ngon-diec-mui-20160731100350144.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/23/30/a-3a359.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','Xxvtxncttnđm','nauan'),(1170203,'Tôm chiên rất đơn giản nhưng vị ngon sẽ khiến bạn nhớ mãi','Tôm chiên kèm sốt tương cà tuy quen mà lạ, tuy đơn giản nhưng mùi vị thơm ngon đậm đà ăn với cơm trắng thì không thể chê.','http://m.afamily.vn/tom-chien-rat-don-gian-nhung-vi-ngon-se-khien-ban-nho-mai-2016080109225235.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/a-45f5b.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','Tcrđgnvnskbnm','nauan'),(1170204,'Bữa trưa ngày mưa ăn cà ri tôm là chuẩn không cần chỉnh!','Món cà ri tôm ăn kèm với bún hoặc cơm trắng đều hợp. Riêng rau củ đi kèm, bạn có thể tùy biến cho phù hợp, chẳng hạn như bắp non, cà rốt… hay chỉ đơn giản là tôm sốt riêng với cà ri cũng đủ ngon rồi.','http://m.afamily.vn/bua-trua-ngay-mua-an-ca-ri-tom-la-chuan-khong-can-chinh-20160817043221760.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/09/17/a-bb44f.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','Btnmăcrtlckcc','nauan'),(1170205,'Giòn rụm hấp dẫn món bánh tôm chiên kiểu Thái','Bánh tôm chiên kiểu Thái với phần nhân tôm dai ngon cùng lớp vỏ bánh giòn ruộm, vàng nâu óng ả trông ngon mắt vô cùng, mới nhìn thôi là đã muốn ăn ngay rồi!','http://m.afamily.vn/gion-rum-hap-dan-mon-banh-tom-chien-kieu-thai-2016080806029674.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/08/A-12135.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','GrhdmbtckT','nauan'),(1170206,'Ăn sang chẳng kém nhà hàng với tôm chiên dừa thơm phức','Tôm chiên dừa chấm sốt chanh có màu sắc tươi mắt mà hương dậy thơm điếc mũi khiến bạn mới ngửi thôi cũng khó lòng cưỡng lại.','http://m.afamily.vn/an-sang-chang-kem-nha-hang-voi-tom-chien-dua-thom-phuc-2016081202025684.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/09/a-0c9ab.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','Ăscknhvtcdtp','nauan'),(1170207,'Bữa tối ngon miệng với đậu thịt viên chiên kiểu mới','Đậu thịt viên chiên có lớp vỏ giòn giòn còn nhân bên trong lại mềm mại. Nhờ có đậu phụ nên vị béo ngậy của tôm thịt trộn kèm được cân bằng, vừa thanh đạm lại vừa dinh dưỡng hơn.','http://m.afamily.vn/bua-toi-ngon-mieng-voi-dau-thit-vien-chien-kieu-moi-20160802103058608.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/a-04159.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','Btnmvđtvckm','nauan'),(1170208,'Lạ miệng với hương vị tươi giòn của bánh mì kẹp kiểu mới','Bánh mì kẹp salad tôm vô cùng ngon miệng bởi sự kết hợp hoàn hảo giữa vỏ bánh mềm thơm mùi bơ với phần nhân tôm salad tươi ngọt.','http://m.afamily.vn/la-mieng-voi-huong-vi-tuoi-gion-cua-banh-mi-kep-kieu-moi-20160904095159422.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/09/a-62f16.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','Lmvhvtgcbmkkm','nauan'),(1170209,'Món ngon cuối tuần: Chả tôm chiên giòn dai ngon “rất đã”','Món chả tôm chiên có một sức hấp dẫn không thể chối từ bởi màu sắc bắt mắt và mùi thơm vô cùng quyến rũ.','http://m.afamily.vn/mon-ngon-cuoi-tuan-cha-tom-chien-gion-dai-ngon-rat-da-20160820035040242.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/09/17/A-8d28e.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','MnctCtcgdn“đ','nauan'),(1170210,'Đơn giản là tôm luộc nhưng với cách làm này thì lại ngon không tưởng','Cách làm món tôm luộc thì thật đơn giản nhưng phải làm thế nào để tôm được ngon nhất và có được nước chấm ngon hoàn hảo lại là việc mà không phải ai cũng biết.','http://m.afamily.vn/don-gian-la-tom-luoc-nhung-voi-cach-lam-nay-thi-lai-ngon-khong-tuong-20160808030652120.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/A-bfe14.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','Đgltlnvclntlnkt','nauan'),(1170211,'Dân dã mà lạ miệng với món tôm rim hẹ đậm đà','Tôm rim hẹ với vị giòn giòn mà đậm đà ngon cơm, thỉnh thoảng xen kẽ vài cọng hẹ thanh thanh ăn hay ho phải biết!','http://m.afamily.vn/dan-da-ma-la-mieng-voi-mon-tom-rim-he-dam-da-20160901093513631.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/09/A-18822.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','Ddmlmvmtrhđđ','nauan'),(1170212,'Món ngon cuối tuần: Tôm xiên nướng kiểu Ý','Chỉ với vài ba bước đơn giản, bạn đã có thể hoàn thành món tôm xiên nướng cùng với hành tây hấp dẫn, thơm lừng cả một góc bếp!','http://m.afamily.vn/mon-ngon-cuoi-tuan-tom-xien-nuong-kieu-y-2016091503264037.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/09/07/A-ad73f.jpg',0,'nauan_tom',0,'M','2016-10-14 04:49:25','MnctTxnkÝ','nauan'),(1170213,'Muốn giảm cân nhanh, hãy nhớ ăn sáng với 5 món này!','Bữa sáng là bữa quan trọng nhất vì nó mở đầu cho quá trình trao đổi chất của cơ thể bạn. Để đạt được mục tiêu giảm cân nhanh chóng, bạn nhớ ăn sáng một cách thông minh nhé!','http://m.afamily.vn/an-ngon/muon-giam-can-nhanh-hay-nho-an-sang-voi-5-mon-nay-20160223082846901.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/02/A-accc3.jpg',0,'trung',0,'M','2016-10-14 04:49:26','Mgcnhnăsv5mn','nauan'),(1170214,'Cách đơn giản làm món trứng cuộn ngon đẹp như bánh gato!','Thoạt nhìn hẳn ai cũng nghĩ đây là những khoanh bánh ngọt, thế nhưng thực chất đó lại là món trứng cuộn cực ngon cho bữa tối đấy!','http://m.afamily.vn/an-ngon/cach-don-gian-lam-mon-trung-cuon-ngon-dep-nhu-banh-gato-20160304014343478.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/03/A-e8488.jpg',0,'trung',0,'M','2016-10-14 04:49:26','Cđglmtcnđnbg','nauan'),(1170215,'3 món ngon từ trứng cho bữa sáng nhanh gọn đủ chất','Vào những bữa sáng bận rộn và bạn vẫn muốn tự tay chuẩn bị cho gia đình một bữa sáng đảm bảo đầy đủ chất dinh dưỡng thì đây 3 món ngon từ trứng là giải pháp cho bạn.','http://m.afamily.vn/an-ngon/3-mon-ngon-tu-trung-cho-bua-sang-nhanh-gon-du-chat-20160319113217704.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/03/A-f74ef.jpg',0,'trung',0,'M','2016-10-14 04:49:26','3mnttcbsngđc','nauan'),(1170216,'Làm món trứng hấp vân ngon - đẹp mau lẹ qua video hướng dẫn','Món trứng hấp vân không những đẹp mà còn ngon và dễ làm, rất hợp trong những ngày gia đình có khách hay chỉ đơn giản là bạn muốn làm mới bữa ăn gia đình.','http://m.afamily.vn/an-ngon/lam-mon-trung-hap-van-ngon-dep-mau-le-qua-video-huong-dan-20160325115354505.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/03/A-c3260.png',0,'trung',0,'M','2016-10-14 04:49:26','Lmthvn-đmlqvhd','nauan'),(1170217,'Thêm một kiểu làm trứng chiên bông xốp chưa ăn đã mê','Bạn muốn chế biến một món ăn thật đơn giản, không chỉ bổ dưỡng mà còn ngon mắt ngon miệng thì món trứng chiên bông xốp này là một món ăn đáng để bạn thử nghiệm đó.','http://m.afamily.vn/an-ngon/them-mot-kieu-lam-trung-chien-bong-xop-chua-an-da-me-20160329013537566.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/03/A-e25d1.jpg',0,'trung',0,'M','2016-10-14 04:49:26','Tmkltcbxcăđm','nauan'),(1170218,'Xốp mềm bánh trứng nướng kiểu mới cho bữa sáng ngon miệng','Từng miếng bánh trứng nướng vừa xốp giòn, béo ngậy thơm vị phô mai và trứng hẳn sẽ đem đến cho bạn một món ăn thật tuyệt vời đấy.','http://m.afamily.vn/xop-mem-banh-trung-nuong-kieu-moi-cho-bua-sang-ngon-mieng-20160324040924253.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/03/A-97ffe.jpg',0,'trung',0,'M','2016-10-14 04:49:26','Xmbtnkmcbsnm','nauan'),(1170219,'Cả nhà khen ngon với biến tấu mới từ trứng chiên','Trứng chiên hấp tôm mềm thơm, với phần nhân tôm chắc thịt đậm vị, dùng cùng cơm nóng sẽ rất tuyệt.','http://m.afamily.vn/ca-nha-khen-ngon-voi-bien-tau-moi-tu-trung-chien-20160329035255555.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/03/A-f636a.jpg',0,'trung',0,'M','2016-10-14 04:49:26','Cnknvbtmttc','nauan'),(1170220,'Cách làm trứng cuộn kiểu mới \"ngon hết sẩy\"','Bữa cơm tối sẽ trở nên sinh động, đẹp mắt và ngon miệng hơn với món trứng cuộn cà chua nhiều lớp. Bạn chỉ cần mất khoảng 15 phút là có món mới đổi bữa cho cả gia đình rồi!','http://m.afamily.vn/cach-lam-trung-cuon-kieu-moi-ngon-het-say-20160412012052696.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/04/A-46f65.jpg',0,'trung',0,'M','2016-10-14 04:49:26','Cltckm\"hs','nauan'),(1170221,'Cả nhà khen ngon với món chả trứng thơm ngon lại dễ làm','Món chả trứng nướng bạn có thể ăn như một món mặn trong bữa cơm trong gia đình, làm thêm ít đồ chua, tí mỡ hành là có ngay đĩa cơm chả trứng ngon hấp dẫn.','http://m.afamily.vn/ca-nha-khen-ngon-voi-mon-cha-trung-thom-ngon-lai-de-lam-20160502062936953.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/05/A-4936e.jpg',0,'trung',0,'M','2016-10-14 04:49:26','Cnknvmcttnldl','nauan'),(1170222,'Thêm một cách làm trứng cuộn \"ngon ơi là ngon\"','Trứng cuộn có thêm nguyên liệu là cà rốt sẽ cung cấp thêm nhiều giá trị dinh dưỡng nhờ nguồn chất xơ, vitamin dồi dào và giúp cho món ăn có hình thức bắt mắt, kích thích vị giác hơn hẳn.','http://m.afamily.vn/them-mot-cach-lam-trung-cuon-ngon-oi-la-ngon-20160523040320254.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/05/A-ad1a3.jpg',0,'trung',0,'M','2016-10-14 04:49:26','Tmcltc\"ơln','nauan'),(1170223,'Thêm một cách làm trứng hấp ngon cực kỳ','Chỉ vài phút chuẩn bị là bạn đã có thể thưởng thức món trứng hấp đậu phụ vừa lạ vừa ngon này rồi!','http://m.afamily.vn/them-mot-cach-lam-trung-hap-ngon-cuc-ky-2016052907361468.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/05/A-76a70.jpg',0,'trung',0,'M','2016-10-14 04:49:26','Tmclthnck','nauan'),(1170224,'Bỏ túi thêm 2 món trứng ngon lạ cho bữa tối đưa cơm','Cùng vào bếp chế biến 2 món trứng ngon mà đơn giản đảm bảo cả nhà phải gật gù khen ngon đấy nhé!','http://m.afamily.vn/bo-tui-them-2-mon-trung-ngon-la-cho-bua-toi-dua-com-20160614071134661.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/06/A-6ec5a.jpg',0,'trung',0,'M','2016-10-14 04:49:26','Btt2mtnlcbtđc','nauan'),(1170225,'4 bước làm bánh trứng tổ chim ngon mắt cho bữa sáng','Chỉ với những nguyên liệu đơn giản bạn đã có thể làm bánh trứng tổ chim thơm nức, béo ngậy mềm ngon cực kỳ phù hợp để khởi đầu ngày mới.','http://m.afamily.vn/4-buoc-lam-banh-trung-to-chim-ngon-mat-cho-bua-sang-20160708123155132.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/06/a-76d3c.jpg',0,'trung',0,'M','2016-10-14 04:49:26','4blbttcnmcbs','nauan'),(1170226,'Bữa tối lạ miệng với cách làm trứng hấp mới toanh!','Với cách làm trứng hấp thế này, đảm bảo mâm cơm nhà bạn sẽ vô cùng hấp dẫn và cả nhà sẽ tấm tắc khen ngon.','http://m.afamily.vn/bua-toi-la-mieng-voi-cach-lam-trung-hap-moi-toanh-20160720010835213.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/12/a-71e15.jpg',0,'trung',0,'M','2016-10-14 04:49:26','Btlmvclthmt','nauan'),(1170227,'Quên ngay kiểu làm trứng cuộn cũ rích đi, bạn sẽ khiến cả nhà \"tròn mắt\" khen ngon vì hương vị cực lạ này','Với cách làm trứng cuộn kiểu này. Đảm bảo bất cứ ai ăn cũng phải trầm trồ khen ngợi tay nghề nấu ăn của bạn đấy!','http://m.afamily.vn/quen-ngay-kieu-lam-trung-cuon-cu-rich-di-ban-se-khien-ca-nha-tron-mat-khen-ngon-vi-huong-vi-cuc-la-nay-20160710111248652.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/06/A-2009d.jpg',0,'trung',0,'M','2016-10-14 04:49:26','Qnkltccrđbskcn\"mknvhvcln','nauan'),(1170228,'Tối nay nhà mình có trứng hấp kiểu Nhật lạ mà ngon lắm nhé!','Món trứng hấp kiểu Nhật này đảm bảo ai cũng thích mê, trứng mềm mịn đưa một miếng vào miệng đã thấy tan ngay ra cực kỳ thơm ngon.','http://m.afamily.vn/toi-nay-nha-minh-co-trung-hap-kieu-nhat-la-ma-ngon-lam-nhe-20160801093342669.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/A-7db47.jpg',0,'trung',0,'M','2016-10-14 04:49:26','TnnmcthkNlmnln','nauan'),(1170229,'Làm món trứng kho kiểu này, bạn sẽ biết được thế nào là ngon đến ngỡ ngàng!','Vào những hôm lười vào bếp, bạn chỉ cần “hành động” với 3 bước cực nhanh là sẽ có ngay nồi trứng kho ngon bá cháy, ăn bao nhiêu cơm cũng không đủ!','http://m.afamily.vn/lam-mon-trung-kho-kieu-nay-ban-se-biet-duoc-the-nao-la-ngon-den-ngo-ngang-20160904094214809.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/09/A-b52e8.jpg',0,'trung',0,'M','2016-10-14 04:49:26','Lmtkknbsbđtnlnđnn','nauan'),(1170230,'Chỉ là trứng chiên nhưng với cách làm này bạn sẽ có món trứng vừa đẹp vừa ngon','Với món trứng chiên này đảm bảo mâm cơm tối nhà bạn sẽ đẹp mắt và ngon miệng hơn rất nhiều đấy!','http://m.afamily.vn/chi-la-trung-chien-nhung-voi-cach-lam-nay-ban-se-co-mon-trung-vua-dep-vua-ngon-20160909012742608.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/09/07/A-913ab.jpg',0,'trung',0,'M','2016-10-14 04:49:26','Cltcnvclnbscmtvđvn','nauan'),(1170231,'Học người Nhật cách làm trứng cuộn ngon vô đối','Cách làm trứng cuộn omelet có các lớp trứng được cuộn thành từng lớp, ở cách làm này đã được bổ sung thêm rong biển và phô mai lát để làm hương vị phong phú và hấp dẫn hơn.','http://m.afamily.vn/hoc-nguoi-nhat-cach-lam-trung-cuon-ngon-vo-doi-20160823091532564.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/21/a-736b6.jpg',0,'trung',0,'M','2016-10-14 04:49:26','HnNcltcnvđ','nauan'),(1170232,'12 món trứng cực đơn giản nhưng sẽ giúp bạn \"ghi điểm\" trong mắt cả nhà','Trứng luôn là món ăn được cả nhà yêu thích, vừa dễ làm vừa bổ dưỡng. Cùng điểm qua 12 món trứng đơn giản mà ngon xuất sắc sau đây nhé!','http://m.afamily.vn/12-mon-trung-cuc-don-gian-nhung-se-giup-ban-ghi-diem-trong-mat-ca-nha-2016092601033311.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/09/20/A-e3b45.png',0,'trung',0,'M','2016-10-14 04:49:26','1mtcđgnsgb\"đtmcn','nauan'),(1170233,'Món ngon cuối tuần: Mỳ Ý sốt bò băm ','Món mỳ Ý này khá dễ ăn với sốt cà chua và mùi thơm đặc biệt của các loại lá thơm nên ai cũng có thể ăn no mà không bị ngán như khi ăn nhiều loại đồ Tây khác.','http://m.afamily.vn/an-ngon/mon-ngon-cuoi-tuan-my-y-sot-bo-bam-20111029083519436.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2011/10/200911afamilyANmyybobam-AVA_f877e.jpg',0,'mony',0,'M','2016-10-14 04:49:27','MnctMÝsbb','nauancacnuoc'),(1170234,'Pizza nhí xinh xinh mà giòn tan ','Những chiếc bánh pizza nhí nóng hổi giòn rụm chắc chắn sẽ được các bé vô cùng yêu thích đấy, bạn hãy thử ngay nhé!','http://m.afamily.vn/an-ngon/pizza-nhi-xinh-xinh-ma-gion-tan-20111109031718825.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2011/11/11110afamily-AN-pizza-mini-AVA_e7bf0.jpg',0,'mony',0,'M','2016-10-14 04:49:27','Pnxxmgt','nauancacnuoc'),(1170235,'2 cách ăn bánh mỳ tuyệt ngon theo kiểu Ý','Rất ngon miệng và tốt cho sức khỏe, bạn có thể dùng bánh mỳ kiểu này như món ăn sáng hoặc món khai vị đều phù hợp.','http://m.afamily.vn/an-ngon/2-cach-an-banh-my-tuyet-ngon-theo-kieu-y-20111110121024237.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2011/11/111111afamily-AN-banh-my-bruchestaAVA_441fe.jpg',0,'mony',0,'M','2016-10-14 04:49:27','2căbmtntkÝ','nauancacnuoc'),(1170236,'Cuối tuần, đãi cả nhà món Lasagna trứ danh từ nước Ý ','Lasagna có nhiều cách chế biến khác nhau, tuy nhiên phổ biến nhất vẫn là lasagna với sốt Bolognese. Đây là một trong những món khoái khẩu của nhà mình vào ngày trời lạnh.','http://m.afamily.vn/an-ngon/cuoi-tuan-dai-ca-nha-mon-lasagna-tru-danh-tu-nuoc-y-20111205020749327.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2011/12/211111afamilyANlasagna-AVA_f8f18.jpg',0,'mony',0,'M','2016-10-14 04:49:27','CtđcnmLtdtnÝ','nauancacnuoc'),(1170237,'Panna Cotta dâu - món tráng miệng hoàn hảo từ nước Ý ','Món Panna Cotta vị dâu vừa dễ làm mà ăn lại ngon và trông rất đẹp mắt là một sự lựa chọn thú vị cho món tráng miệng của gia đình bạn vào những ngày nghỉ này.','http://m.afamily.vn/an-ngon/panna-cotta-dau-mon-trang-mieng-hoan-hao-tu-nuoc-y-20120101104624839.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2012/01/120102afamily-AN-Strawberry-Panna-cotta-AVA_c444c.jpg',0,'mony',0,'M','2016-10-14 04:49:27','PCd-mtmhhtnÝ','nauancacnuoc'),(1170238,'Valentine ngọt ngào khó quên với bánh Tiramisu siêu tốc ','Bánh Tiramisu nồng nàn hương vị tình yêu với chút béo ngậy của kem phô mai, chút ngọt ngào xen lẫn đăng đắng của cà phê, cacao và thơm mùi rượu Rum vô cùng quyến rũ.','http://m.afamily.vn/an-ngon/valentine-ngot-ngao-kho-quen-voi-banh-tiramisu-sieu-toc-20120212074524420.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2012/02/aVA_55b79.jpg',0,'mony',0,'M','2016-10-14 04:49:27','VnnkqvbTst','nauancacnuoc'),(1170239,'Panna Cotta chocolate - món tráng miệng hấp dẫn từ nước Ý ','Vị béo ngậy, mềm mượt của Panna Cotta rất hợp với mùi thơm và chút đăng đắng của chocolate khiến món ăn này dễ dàng chinh phục các thực khách đủ mọi lứa tuổi.','http://m.afamily.vn/an-ngon/panna-cotta-chocolate-mon-trang-mieng-hap-dan-tu-nuoc-y-20120223024216215.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2012/02/AVA_2e649.jpg',0,'mony',0,'M','2016-10-14 04:49:27','PCc-mtmhdtnÝ','nauancacnuoc'),(1170240,'Mát mịn thơm ngon món Panna Cotta việt quất','Trái việt quất không những ngon mà còn có giá trị dinh dưỡng rất cao, hỗ trợ tốt việc ngăn ngừa các bệnh tim mạch, tiểu đường… Món bánh này rất dễ ăn vì nó có vị mát và hơi chua chua của trái việt quất.','http://m.afamily.vn/an-ngon/mat-min-thom-ngon-mon-panna-cotta-viet-quat-20120430041937703.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2012/05/AVA_64dc9.jpg',0,'mony',0,'M','2016-10-14 04:49:27','MmtnmPCvq','nauancacnuoc'),(1170241,'Đá bào cà phê giải nhiệt mùa hè ','Tuy đây là một món rất ngon và hấp dẫn nhưng bạn không nên ăn quá nhiều kẻo bị viêm họng nhé!','http://m.afamily.vn/an-ngon/da-bao-ca-phe-giai-nhiet-mua-he-20120430051234787.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2012/05/AVA_28f30.jpg',0,'mony',0,'M','2016-10-14 04:49:27','Đbcpgnmh','nauancacnuoc'),(1170242,'Ngon lạ món Panna Cotta cà phê kem Whisky','Panna Cotta cà phê có mùi thơm rất đặc biệt, thêm vị đắng nhẹ của cà phê hòa cùng vị rượu nhẹ nhàng thoang thoảng nên ăn béo ngậy mà không ngán.','http://m.afamily.vn/an-ngon/ngon-la-mon-panna-cotta-ca-phe-kem-whisky-20120430044052984.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2012/05/AVA_8a0ad.jpg',0,'mony',0,'M','2016-10-14 04:49:27','NlmPCcpkW','nauancacnuoc'),(1170243,'Ăn sáng ngon với món Bruschetta cà tím ','Cà tím béo mềm, ngọt thanh, lại thơm thơm vị olive quyện với các loại gia vị vô cùng hấp dẫn.','http://m.afamily.vn/an-ngon/an-sang-ngon-voi-mon-bruschetta-ca-tim-20120610044948257.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2012/06/AVA_37edc.jpg',0,'mony',0,'M','2016-10-14 04:49:27','ĂsnvmBct','nauancacnuoc'),(1170244,'Ăn sáng ngon với mỳ Ý siêu tốc','Nếu bạn là tín đồ của món pasta từ nước Ý nhưng ngại độ béo của xốt kem tươi hay ngán thịt băm với xốt cà của món bolognese thì món này là giải pháp tốt cho bạn.','http://m.afamily.vn/an-ngon/an-sang-ngon-voi-my-y-sieu-toc-2012091305339194.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2012/09/A-e9dc6.jpg',0,'mony',0,'M','2016-10-14 04:49:27','ĂsnvmÝst','nauancacnuoc'),(1170245,'Không cần lò nướng, làm bánh nho tuyệt ngon','Màu tím tuyệt đẹp của quả nhỏ đen cùng với hương vị tuyệt vời của món bánh khiến không ai có thể chối từ món này khi nhìn thấy nó!','http://m.afamily.vn/an-ngon/khong-can-lo-nuong-lam-banh-nho-tuyet-ngon-2012092307312312.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2012/09/02/A-401a8.jpg',0,'mony',0,'M','2016-10-14 04:49:27','Kclnlbntn','nauancacnuoc'),(1170246,'Thử món bánh quy hạnh nhân Cantucci từ nước Ý','Theo truyền thống bánh sẽ được dùng kèm với một loại rượu nhẹ nhưng cũng sẽ rất tuyệt khi bạn dùng kèm một ly cà phê ấm nóng trong tiết trời dịu mát này.','http://m.afamily.vn/an-ngon/thu-mon-banh-quy-hanh-nhan-cantucci-tu-nuoc-y-20120926062924490.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2012/09/02/A-0ba74.jpg',0,'mony',0,'M','2016-10-14 04:49:27','TmbqhnCtnÝ','nauancacnuoc'),(1170247,'Bánh nơ chiên giòn tan thơm phức','Bánh đơn giản dễ làm vô cùng phù hợp trong tiết trời mát mẻ này, dùng kèm một tách trà nóng sẽ rất hợp.','http://m.afamily.vn/an-ngon/banh-no-chien-gion-tan-thom-phuc-20121006064749163.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2012/10/01/A-def7c.jpg',0,'mony',0,'M','2016-10-14 04:49:27','Bncgttp','nauancacnuoc'),(1170248,'Mềm xốp món bánh Ciambella từ Italy','Món bánh mềm thơm này ắt hẳn sẽ khiến ai cũng phải yêu thích vì nó rất mềm và bạn không hề phải bận tâm xem nó có bị khô khi để lâu hay không.','http://m.afamily.vn/an-ngon/mem-xop-mon-banh-ciambella-tu-italy-20121010111133419.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2012/10/02/A-943c7.jpg',0,'mony',0,'M','2016-10-14 04:49:27','MxmbCtI','nauancacnuoc'),(1170249,'Gnocchi khoai tây - món pasta cực ngon từ Ý','Gnocchi từ khoai tây là món ăn có nguồn gốc cổ xưa nhất từ thế kỷ 17 và đến ngày nay nó vẫn luôn là lựa chọn hấp dẫn cho các bà nội trợ ở Ý.','http://m.afamily.vn/an-ngon/gnocchi-khoai-tay-mon-pasta-cuc-ngon-tu-y-20121113032331246.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2012/11/02/A-5a470.jpg',0,'mony',0,'M','2016-10-14 04:49:27','Gkt-mpcntÝ','nauancacnuoc'),(1170250,'Nui xốt vang đỏ thịt bò đậm chất Châu Âu','Món này rất ngon, dễ ăn mà lại không cầu kì, các bạn có thể làm nhiều xốt để dành cho lần sau mà vẫn giữ được hương thơm của món ăn.','http://m.afamily.vn/an-ngon/nui-xot-vang-do-thit-bo-dam-chat-chau-au-20121117121948192.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2012/11/03/A-ed810.jpg',0,'mony',0,'M','2016-10-14 04:49:27','NxvđtbđcCÂ','nauancacnuoc'),(1170251,'Pizza cuộn đổi món cho bữa sáng cuối tuần','(Afamily.vn) Bạn đã quá quen với những chiếc pizza tròn truyền thống, giờ là lúc có những trải nghiệm mới mẻ với chiếc pizza cuộn đẹp mắt và không kém phần thơm ngon!','http://m.afamily.vn/an-ngon/pizza-cuon-doi-mon-cho-bua-sang-cuoi-tuan-20130222081157433.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2013/03/02/A-d9809.jpg',0,'mony',0,'M','2016-10-14 04:49:27','Pcđmcbsct','nauancacnuoc'),(1170252,'Cách nấu xốt bò băm kiểu Ý cực chuẩn','(Afamily.vn) Nếu bạn vẫn thường xuyên phải đi mua những chai xốt bò băm để làm món mỳ Ý thì với cách nấu xốt bò băm kiểu Ý này bạn sẽ không bao giờ muốn dùng loại xốt đi mua nữa!','http://m.afamily.vn/an-ngon/cach-nau-xot-bo-bam-kieu-y-cuc-chuan-20130311062843524.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2013/03/03/A-2acfb.jpg',0,'mony',0,'M','2016-10-14 04:49:27','CnxbbkÝcc','nauancacnuoc'),(1170253,'Bữa trưa ngon miệng với món Kimbap kiểu mới','Do hoàn toàn không dùng cơm nên món Kimbap này sẽ rất hợp với những bạn đang muốn giảm cân giữ dáng đấy!','http://m.afamily.vn/an-ngon/bua-trua-ngon-mieng-voi-mon-kimbap-kieu-moi-20151112103559400.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Wu7WDLWoryYaHiuIgQpJe1qNJ4ax/Image/2015/11/A-810d2.jpg',0,'monhan',0,'M','2016-10-14 04:49:28','BtnmvmKkm','nauancacnuoc'),(1170254,'Ngày đầu đông xuýt xoa mực ngào kiểu Hàn ngon tuyệt!','Với vị mặn - ngọt - cay vừa ăn cùng vị dai dai đặc trưng của mực khô, mực ngào kiểu Hàn hứa hẹn sẽ là món ăn vặt cực hot khi mùa đông về!','http://m.afamily.vn/an-ngon/ngay-dau-dong-xuyt-xoa-muc-ngao-kieu-han-ngon-tuyet-20151126083555420.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2015/11/A-76dbd.jpg',0,'monhan',0,'M','2016-10-14 04:49:28','NđđxxmnkHnt','nauancacnuoc'),(1170255,'Chỉ bạn cách muối kim chi chua giòn chuẩn ngon của người Hàn Quốc!','Mùa đông tới cũng là mùa cải thảo ngập tràn các quầy rau trong siêu thị hay chợ, bạn hãy tranh thủ muối kim chi cải thảo chua giòn ăn kèm với các món kho, chiên cực ngon nhé!','http://m.afamily.vn/an-ngon/chi-ban-cach-muoi-kim-chi-chua-gion-chuan-ngon-cua-nguoi-han-quoc-20151217023116181.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2015/12/A-d67b6.jpg',0,'monhan',0,'M','2016-10-14 04:49:28','CbcmkccgcncnHQ','nauancacnuoc'),(1170256,'Xuýt xoa mực xào cay kiểu Hàn trong ngày gió lạnh','Mực xào cay kiểu Hàn Quốc với công thức làm món mực xào cực kỳ đơn giản, với đĩa mực xào cay cay ăn cùng với cơm nóng thì còn gì bằng với thời tiết lạnh lạnh mùa tết năm nay.','http://m.afamily.vn/an-ngon/xuyt-xoa-muc-xao-cay-kieu-han-trong-ngay-gio-lanh-20160101070231367.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/01/A-b5009.jpg',0,'monhan',0,'M','2016-10-14 04:49:28','XxmxckHtngl','nauancacnuoc'),(1170257,'Thêm món canh ngon mời cả nhà xuýt xoa chiều đông','Cay cay vị ớt, ngọt giòn vị bí, dai dai vị thịt - đó là những gì món canh ngon này sẽ mang đến cho gia đình bạn trong bữa cơm chiều đông giá lạnh.','http://m.afamily.vn/an-ngon/them-mon-canh-ngon-moi-ca-nha-xuyt-xoa-chieu-dong-20160105011147733.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/01/A-250dc.jpg',0,'monhan',0,'M','2016-10-14 04:49:28','Tmcnmcnxxcđ','nauancacnuoc'),(1170258,'Nấu canh kim chi nóng hổi ăn tối ngày mưa lạnh!','Trong những ngày đông lạnh giá này mà có một tô canh kim chi chua cay nóng hổi thì bữa tối sẽ ấm áp biết mấy phải không bạn?','http://m.afamily.vn/an-ngon/nau-canh-kim-chi-nong-hoi-an-toi-ngay-mua-lanh-20160111112146959.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/01/A-6cc53.jpg',0,'monhan',0,'M','2016-10-14 04:49:28','Nckcnhătnml','nauancacnuoc'),(1170259,'Miến trộn kiểu Hàn Quốc đổi món cho bữa sáng thanh nhẹ dễ ăn','Sau những ngày Tết với các món ăn đầy chất đạm, bạn hãy giúp cả nhà cân bằng lại khẩu vị với món miến trộn kiểu Hàn Quốc nhiều rau củ này nhé!','http://m.afamily.vn/an-ngon/mien-tron-kieu-han-quoc-doi-mon-cho-bua-sang-thanh-nhe-de-an-20160210060816100.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/02/A-2e041.jpg',0,'monhan',0,'M','2016-10-14 04:49:28','MtkHQđmcbstndă','nauancacnuoc'),(1170260,'Cơm cuộn đầy sắc màu: Làm dễ ăn ngon','Bữa trưa của bạn sẽ thật ngon và lạ miệng với món cơm cuộn cực ngon này!','http://m.afamily.vn/an-ngon/com-cuon-day-sac-mau-lam-de-an-ngon-20160301110316310.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/03/A-615e0.jpg',0,'monhan',0,'M','2016-10-14 04:49:28','CcđsmLdăn','nauancacnuoc'),(1170261,'Chua cay ngon miệng với cơm rang kim chi ngon tuyệt!','Ngày cuối tuần muốn nghỉ ngơi, bạn hãy làm món cơm rang kim chi vừa nhanh gọn lại vẫn ngon miệng này nhé!','http://m.afamily.vn/an-ngon/chua-cay-ngon-mieng-voi-com-rang-kim-chi-ngon-tuyet-2016030510130135.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/03/A-5bed0.jpg',0,'monhan',0,'M','2016-10-14 04:49:28','Ccnmvcrkcnt','nauancacnuoc'),(1170262,'Học cách làm kim chi dưa chuột chua giòn ngon bá cháy!','Trong bữa cơm gia đình ngoài các món ăn chính chúng ta cần có thêm những món rau củ ăn nhẹ, món kim chi dưa chuột vừa lạ miệng vừa dễ làm sẽ là một thay đổi mới mẻ bạn nên thử!','http://m.afamily.vn/an-ngon/hoc-cach-lam-kim-chi-dua-chuot-chua-gion-ngon-ba-chay-20160306095550914.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/03/A-82708.jpg',0,'monhan',0,'M','2016-10-14 04:49:28','Hclkcdccgnbc','nauancacnuoc'),(1170263,'Làm chả tôm mực cho bữa cơm cuối tuần thêm ngon','Chả tôm mực kiểu Hàn Quốc với nhiều màu sắc bắt mắt cùng vị ngọt của tôm, dai dai của mực và thanh tao của nấm sẽ khiến cả nhà bạn thích mê.','http://m.afamily.vn/lam-cha-tom-muc-cho-bua-com-cuoi-tuan-them-ngon-2016033002451995.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/03/A-52b1c.jpg',0,'monhan',0,'M','2016-10-14 04:49:28','Lctmcbccttn','nauancacnuoc'),(1170264,'Làm bingsu trái dừa - món kem đang khiến cộng đồng mê mẩn','Món Bingsu trái dừa tuy được làm tại nhà, không cần máy làm tuyết nhưng chắc chắn sẽ mang đến cho bạn món ngon giải khát ngon tuyệt trong mùa nóng năm nay.','http://m.afamily.vn/lam-bingsu-trai-dua-mon-kem-dang-khien-cong-dong-me-man-20160415040252534.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/04/A-478ac.png',0,'monhan',0,'M','2016-10-14 04:49:28','Lbtd-mkđkcđmm','nauancacnuoc'),(1170265,'Mách bạn tuyệt chiêu làm món chân gà cay đúng chuẩn Hàn Quốc','Những chiếc chân gà cay giòn sần sật, vị chua cay hài hòa, đậm đà khiến bạn không thể chối từ!','http://m.afamily.vn/mach-ban-tuyet-chieu-lam-mon-chan-ga-cay-dung-chuan-han-quoc-20160507034138206.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/05/A-c2791.jpg',0,'monhan',0,'M','2016-10-14 04:49:28','MbtclmcgcđcHQ','nauancacnuoc'),(1170266,'Cuối tuần làm miến trộn siêu ngon lại nhanh gọn ','Vị dai dai của miến cùng với vị béo của mè, trứng, vị giòn mát của hành tây, cà rốt, vị ngọt của nấm, thịt bò và ớt chuông tạo nên hương vị thơm ngon đặc biệt cho món miến trộn Hàn Quốc này.','http://m.afamily.vn/cuoi-tuan-lam-mien-tron-sieu-ngon-lai-nhanh-gon-20160526122744592.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/05/A-4ca9c.jpg',0,'monhan',0,'M','2016-10-14 04:49:28','Ctlmtsnlng','nauancacnuoc'),(1170267,'Cuối tuần đãi cả nhà gà rán xốt cay ngọt đúng vị Hàn siêu ngon','Nếu bạn là một “fan cuồng” của món gà rán thì hẳn sẽ không thể bỏ qua gà rán xốt cay ngọt kiểu Hàn Quốc cực kì hấp dẫn này!','http://m.afamily.vn/cuoi-tuan-dai-ca-nha-ga-ran-xot-cay-ngot-dung-vi-han-sieu-ngon-20160530065136823.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/05/A-5781a.JPG',0,'monhan',0,'M','2016-10-14 04:49:28','CtđcngrxcnđvHsn','nauancacnuoc'),(1170268,'Canh kim chi thịt heo chua cay cho cơm chiều thêm hấp dẫn','Canh kim chi với phần nước súp cay cay, vị đậm đà của thịt, bên cạnh đó là từng miếng đậu hũ thanh nhẹ, sẽ khiến bất kì ai thưởng thức rồi cũng phải gật gù khen ngon!','http://m.afamily.vn/canh-kim-chi-thit-heo-chua-cay-cho-com-chieu-them-hap-dan-20160427085244427.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/04/A-4f403.jpg',0,'monhan',0,'M','2016-10-14 04:49:28','Ckcthcccccthd','nauancacnuoc'),(1170269,'Cách làm cơm cuộn vừa đẹp vừa ngon cho bữa trưa nhanh gọn','Kimbap khoai lang tím có hương vị thật lạ miệng với phần cơm cuộn có màu tím bắt mắt trông thật xinh xắn, đáng yêu phải không?','http://m.afamily.vn/cach-lam-com-cuon-vua-dep-vua-ngon-cho-bua-trua-nhanh-gon-20160624102930839.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/06/mau/A-e880c.jpg',0,'monhan',0,'M','2016-10-14 04:49:28','Clccvđvncbtng','nauancacnuoc'),(1170270,'Học cách muối củ cải chua giòn siêu ngon của người Hàn Quốc','Củ cải muối là món ăn khá phổ biến trong các gia đình người Hàn. Hãy cùng vào bếp muối củ cải theo đúng cách của người Hàn Quốc nhé!','http://m.afamily.vn/hoc-cach-muoi-cu-cai-chua-gion-sieu-ngon-cua-nguoi-han-quoc-20160817040551509.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/09/17/A-fef8b.jpg',0,'monhan',0,'M','2016-10-14 04:49:28','HcmcccgsncnHQ','nauancacnuoc'),(1170271,'Thải độc giảm cân hiệu quả với canh rong biển thịt bò mát lành','Vào những ngày mưa gió thế này, một bát canh rong biển thịt bò mát lành sẽ giúp cho gia đình mình phấn chấn hơn nhiều phần đấy!','http://m.afamily.vn/thai-doc-giam-can-hieu-qua-voi-canh-rong-bien-thit-bo-mat-lanh-2016082709555923.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/08/27/A-9b5c0.jpg',0,'monhan',0,'M','2016-10-14 04:49:28','Tđgchqvcrbtbml','nauancacnuoc'),(1170272,'Học người Hàn cách làm mỳ trộn cực ngon mà không sợ béo ','Với cách làm mỳ trộn đơn giản và siêu nhanh này bạn sẽ có bữa trưa hấp dẫn mà tiết kiệm thời gian cực kỳ đấy!','http://m.afamily.vn/hoc-nguoi-han-cach-lam-my-tron-cuc-ngon-ma-khong-so-beo-20160918041554459.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/09/15/A-10043.jpg',0,'monhan',0,'M','2016-10-14 04:49:28','HnHclmtcnmksb','nauancacnuoc'),(1170311,'Thơm thơm bánh sừng bò Pháp','Bánh Croissant (bánh sừng bò) của Pháp được coi là một trong những loại bánh ngọt ngon và nổi tiếng nhất ở Châu Âu. Cuối tuần rảnh rỗi bạn thử làm một mẻ bánh của riêng nhà mình xem.','http://m.afamily.vn/an-ngon/thom-thom-banh-sung-bo-phap-20080918014116257.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Images/Uploaded/Share/2008/09/20080918014116257/trangchubanhsungboAF.gif',0,'monphap',0,'M','2016-10-14 04:49:34','TtbsbP','nauancacnuoc'),(1170312,'Thực đơn ăn kiêng kiểu Pháp','Phụ nữ Pháp rất đẹp và rất giỏi giữ thân hình cân đối. Thật ngạc nhiên là họ vẫn luôn ăn tối rất muộn, hầu như ngày nào cũng uống rượu vang mà vẫn giữ được vóc dáng.','http://m.afamily.vn/an-ngon/thuc-don-an-kieng-kieu-phap-20090605010634590.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Images/Uploaded/Share/2009/06/08/french.jpg',0,'monphap',0,'M','2016-10-14 04:49:34','TđăkkP','nauancacnuoc'),(1170313,'Gà marengo - hương vị nước Pháp','Gà marengo là một món ăn của Pháp. Khi dùng không ăn theo thố mà dọn từng phần trên dĩa cho từng người. Gà có hương vị thơm của rượu vang và của bơ, ăn kèm với sandwich chiên vàng.','http://m.afamily.vn/an-ngon/ga-marengo-huong-vi-nuoc-phap-2009121912290828.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Images/Uploaded/Share/2009/12/19/gaa2.jpg',0,'monphap',0,'M','2016-10-14 04:49:34','Gm-hvnP','nauancacnuoc'),(1170314,'Ăn sáng với bánh Crepes kiểu Pháp','Bánh Crepes là món bánh nổi tiếng của Pháp, làm rất nhanh mà ăn lại ngon nữa.','http://m.afamily.vn/an-ngon/an-sang-voi-banh-crepes-kieu-phap-2010083003001525.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Images/Uploaded/Share/2010/08/30/newsnutellacrepesICON.jpg',0,'monphap',0,'M','2016-10-14 04:49:34','ĂsvbCkP','nauancacnuoc'),(1170315,'Gà nấu kiểu Pháp, bạn thử chưa?','Nước Pháp với nền ẩm thực phong phú, được chia ra từng vùng, từng khu vực khác nhau. Mời các bạn thử món gà hầm kiểu miền Nam nước Pháp này, vừa nhanh, gọn lại thơm ngon.','http://m.afamily.vn/an-ngon/ga-nau-kieu-phap-ban-thu-chua-20100917120729830.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Images/Uploaded/Share/2010/09/17/gaa4.jpg',0,'monphap',0,'M','2016-10-14 04:49:34','GnkPbtc','nauancacnuoc'),(1170316,'Pate gan gà kiểu Pháp','Pate gan có rất nhiều công thức và cách chế biến, mình được chia sẻ 1 cách làm rất nhanh và dễ, công thức này mình đã thử nghiêm nhiều lần, được kiểm nghiệm bởi nhiều \"khách hàng\" khó tính.','http://m.afamily.vn/an-ngon/pate-gan-ga-kieu-phap-20101015075826440.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Images/Uploaded/Share/2010/10/15/patea.jpg',0,'monphap',0,'M','2016-10-14 04:49:34','PggkP','nauancacnuoc'),(1170317,'Bánh mì Pháp cho người mới tập làm bánh','Hôm nay mình xin chia sẻ cách làm bánh mì dài, một loại bánh mì Pháp mà thường được gọi là baguettes.','http://m.afamily.vn/an-ngon/banh-mi-phap-cho-nguoi-moi-tap-lam-banh-201011141146421.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Images/Uploaded/Share/2010/11/14/banhmya2.jpg',0,'monphap',0,'M','2016-10-14 04:49:34','BmPcnmtlb','nauancacnuoc'),(1170318,'Gà nấu nho khô - Hương vị nước Pháp','Gà nấu nho khô, cà rốt rất dễ thấy tại các gia đình người Pháp. Món ăn dễ làm mùi vị rất ngon. Thịt gà, cà rốt mềm vị nho chua chua ngọt ngọt hòa vào nhau lạ miệng.','http://m.afamily.vn/an-ngon/ga-nau-nho-kho-huong-vi-nuoc-phap-20110218110015623.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Images/Uploaded/Share/2011/02/18/ganhoa.jpg',0,'monphap',0,'M','2016-10-14 04:49:34','Gnnk-HvnP','nauancacnuoc'),(1170319,'Giữ ấm cơ thể với món soup hành kiểu Pháp ','Mùi thơm của bơ, vị ngọt của thịt bò, ngậy ngậy của pho mai….hòa quyện vào nhau tạo nên sức hấp dẫn vô cùng của món súp hành tây kiểu Pháp. Hãy thưởng thức và cảm nhận nhé!','http://m.afamily.vn/an-ngon/giu-am-co-the-voi-mon-soup-hanh-kieu-phap-20110319074353633.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Images/Uploaded/Share/2011/03/19/ICON-soup-hanh-kieu-Phap.jpg',0,'monphap',0,'M','2016-10-14 04:49:34','GấctvmshkP','nauancacnuoc'),(1170320,'Bữa sáng siêu tốc mà đủ chất với bánh mỳ nướng kiểu Pháp ','Có những điều thật giản dị nhưng luôn làm chúng ta cảm thấy thật hạnh phúc và đủ đầy, ví như việc được khởi đầu mỗi buổi sáng trong căn bếp thơm lừng mùi bánh...','http://m.afamily.vn/an-ngon/bua-sang-sieu-toc-ma-du-chat-voi-banh-my-nuong-kieu-phap-20110828093117298.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2011/08/110829afamily-AN-banh-my-nuong-kieu-phap-AVA_d58b9.jpg',0,'monphap',0,'M','2016-10-14 04:49:34','BsstmđcvbmnkP','nauancacnuoc'),(1170321,'Cơm chiều ngon hơn với trứng tráng kiểu Pháp ','Món trứng béo ngậy, thơm phức và mềm mịn nhưng khi ăn không hề khiến bạn bị ngán do có hành tây và hạt tiêu nữa; ăn cùng cơm sẽ ngon lắm đấy!','http://m.afamily.vn/an-ngon/com-chieu-ngon-hon-voi-trung-trang-kieu-phap-20110907010031181.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2011/09/AVA_d7b23.jpg',0,'monphap',0,'M','2016-10-14 04:49:34','CcnhvttkP','nauancacnuoc'),(1170322,'Bánh rán kiểu Pháp - bạn đã thử chưa?','Món bánh này rất dễ ăn, xốp mềm mà làm không quá khó, chắc chắn không chỉ các bé mà cả những thành viên khác trong gia đình bạn sẽ rất thích đấy!','http://m.afamily.vn/an-ngon/banh-ran-kieu-phap-ban-da-thu-chua-20120310071944447.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2012/03/AVA_372b6.jpg',0,'monphap',0,'M','2016-10-14 04:49:34','BrkP-bđtc','nauancacnuoc'),(1170323,'Clafoutis lê - món bánh hấp dẫn từ nước Pháp','Món bánh có vị ngọt mát của lê kết hợp với vị thơm, đắng nhẹ của chocolate sẽ là một món bánh rất đáng thử trong mùa hè này.','http://m.afamily.vn/an-ngon/clafoutis-le-mon-banh-hap-dan-tu-nuoc-phap-2012042012154960.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2012/04/AVA_6862a.jpg',0,'monphap',0,'M','2016-10-14 04:49:34','Cl-mbhdtnP','nauancacnuoc'),(1170324,'Madeleines - món bánh trứ danh từ nước Pháp ','Madeleines là món bánh đặc trưng nước Pháp với hình vỏ sò, phần giữa nhô lên cao. Khi ăn, miếng bánh mềm thơm nhâm nhi cùng ly trà nóng thì quả thực rất tuyệt.','http://m.afamily.vn/an-ngon/madeleines-mon-banh-tru-danh-tu-nuoc-phap-20120802110439533.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2012/07/01/AVA_3dda1.jpg',0,'monphap',0,'M','2016-10-14 04:49:34','M-mbtdtnP','nauancacnuoc'),(1170325,'Bánh mì chiên dừa cay kiểu Pháp ','Bạn hãy thử đãi cả nhà món bánh mì chiên kiểu Pháp với hương vị thơm ngon mới lạ những cũng rất dễ làm này nhé!','http://m.afamily.vn/an-ngon/banh-mi-chien-dua-cay-kieu-phap-20120812055029696.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2012/08/01/AVA-864f6.jpg',0,'monphap',0,'M','2016-10-14 04:49:34','BmcdckP','nauancacnuoc'),(1170487,'Các \"soái ca\" ĐT Việt Nam háo hức hội quân ở TP HCM','Thầy trò HLV Hữu Thắng đã có mặt tại TP HCM để chuẩn bị chiến dịch AFF Cup 2016.','http://www.24h.com.vn//anh-bong-da-nguoi-dep/cac-soai-ca-dt-viet-nam-hao-huc-hoi-quan-o-tp-hcm-c507a821159.html','24h.com.vn','http://image.24h.com.vn/upload/3-2016/images/2016-09-24/thumbnail/1474704952-anh-dai-dien.jpg',0,'HAUTRUONG',0,'M','2016-10-14 04:49:46','C\"cĐVNhhhqởTH','SPORTNEWS'),(1170488,'Ảnh: MU tưng bừng mở tiệc \"hạ bệ\" nhà vô địch','MU đã có trận đấu thăng hoa, đặc biệt trong hiệp 1 để hạ gục nhà ĐKVĐ.','http://www.24h.com.vn//anh-bong-da-nguoi-dep/anh-mu-tung-bung-mo-tiec-ha-be-nha-vo-dich-c507a821202.html','24h.com.vn','