 (thận) tương tác đến ngũ tạng, làm tăng hương vị và tăng chất lượng của bữa ăn - nguồn cung cấp năng lượng chính cho sự sống.','http://suckhoedoisong.vn/tac-dung-khong-ngo-cua-dua-ca-muoi--n122556.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/hohuong/2016/09/18/dua-muoi-trong-am-thuc-dan-gian1474164074.jpg',0,'BAITHUOC',0,'M','2016-10-14 04:51:16','Tdkncdcm','SUCKHOE'),(1170557,'Biết cách sử dụng đông trùng hạ thảo','SKĐS - Đông trùng hạ thảo (ĐTHT) là dược liệu quý. Đây cũng là thảo dược thật giả lẫn lộn khó lường do nó có giá trị cao, cung không đủ cầu. Tuy nhiên, chúng ta cũng cần biết về một số công dụng của nó.','http://suckhoedoisong.vn/biet-cach-su-dung-dong-trung-ha-thao-n122741.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/nguyenkhanh/2016/09/22/biet-cach-su-dung-dong-trung-ha-thao1474512025.jpg',0,'BAITHUOC',0,'M','2016-10-14 04:51:16','Bcsdđtht','SUCKHOE'),(1170558,'Bài thuốc chữa bong gân','SKĐS - Bong gân nghĩa là bong các tổ chức bám quanh khớp do bị chấn động mạnh quá mức, thường xảy ra sau một chấn thương gián tiếp khi chạy nhảy, trượt ngã.','http://suckhoedoisong.vn/bai-thuoc-chua-bong-gan-n84376.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/_OLD/2014/cay-la-nang-1411261662309.jpg',0,'BAITHUOC',0,'M','2016-10-14 04:51:16','Btcbg','SUCKHOE'),(1170559,'Vỏ rễ dâu trị hen suyễn','SKĐS - Vỏ rễ dâu có tác dụng tả phế bình suyễn, lợi tiểu, tiêu phù. Trị hen suyễn do phế nhiệt; ngoài ra còn có tác dụng lợi niệu, tiêu thũng.','http://suckhoedoisong.vn/vo-re-dau-tri-hen-suyen-n84330.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/_OLD/2014/dau1-68495.jpg',0,'BAITHUOC',0,'M','2016-10-14 04:51:16','Vrdths','SUCKHOE'),(1170560,'10 bài thuốc chữa hôi miệng','SKĐS - Hôi miệng hoặc hơi thở có mùi hôi rất thường gặp ở nhiều người, nhất là khi thức giấc vào buổi sáng sau một đêm ngủ.','http://suckhoedoisong.vn/10-bai-thuoc-chua-hoi-mieng-n84431.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/_OLD/2014/nuocchanh-21b18.jpg',0,'BAITHUOC',0,'M','2016-10-14 04:51:16','1btchm','SUCKHOE'),(1170561,'Bài thuốc từ tỏi và chanh giúp đánh bay mỡ bụng','SKĐS - Ngoài tập luyện, còn có một cách giúp bạn thoát khỏi béo bụng trong thời gian nhanh nhất. Đó là bài thuốc từ tỏi và chanh.','http://suckhoedoisong.vn/bai-thuoc-tu-toi-va-chanh-giup-danh-bay-mo-bung-n122896.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/bichvan/2016/09/26/bai-thuoc-tu-toi-va-chanh-giup-danh-bay-mo-bung1474861900.jpg',0,'BAITHUOC',0,'M','2016-10-14 04:51:16','Btttvcgđbmb','SUCKHOE'),(1170562,'Mầm lúa trị tỳ vị hư nhược','SKĐS - Mầm thóc hay mầm lúa còn gọi là cốc nha (Trung Quốc), có tên khoa học là Oryza sativa L. thuộc họ lúa (Poaceae).','http://suckhoedoisong.vn/mam-lua-tri-ty-vi-hu-nhuoc-n13345.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/_OLD/Images/Uploaded/Share/2011/08/01/mam-lua2.jpg',0,'BAITHUOC',0,'M','2016-10-14 04:51:16','Mlttvhn','SUCKHOE'),(1170563,'8 bài thuốc từ thảo dược giúp xóa nếp nhăn','SKĐS - Bước vào tuổi 30, “dấu vết thời gian” sẽ xuất hiện trên gương mặt của bạn. Đó là những nếp nhăn đáng ghét.','http://suckhoedoisong.vn/8-bai-thuoc-tu-thao-duoc-giup-xoa-nep-nhan-n49563.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/bichvan/2016/09/27/8-bai-thuoc-tu-thao-duoc-giup-xoa-nep-nhan1474943078.png',0,'BAITHUOC',0,'M','2016-10-14 04:51:16','8btttdgxnn','SUCKHOE'),(1170564,'Bài thuốc trị chứng bứt rứt, khó ngủ','SKĐS - Tâm hỏa nóng bứt dứt thường gặp ở tuổi trung niên trở lên, nhất là người tiền sử tăng huyết áp. Người bệnh thường cảm giác bốc nóng ở vùng đầu...','http://suckhoedoisong.vn/bai-thuoc-tri-chung-but-rut-kho-ngu-n122939.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/phamhiep/2016/09/27/bai-thuoc-tri-chung-but-rut-kho-ngu1474981361.jpg',0,'BAITHUOC',0,'M','2016-10-14 04:51:16','Bttcbrkn','SUCKHOE'),(1170565,'Đông y trị chứng vàng da','SKĐS - Vàng da Đông y gọi hoàng đản, là dấu hiệu của nhiều chứng bệnh khác nhau. Đây là một triệu chứng liên quan đến tăng bilirubin trong máu.','http://suckhoedoisong.vn/dong-y-tri-chung-vang-da-n84782.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/_OLD/2014/vang-da-fc74c.png',0,'BAITHUOC',0,'M','2016-10-14 04:51:16','Đytcvd','SUCKHOE'),(1170566,'5 bài thuốc trị trứng cá hiệu quả','SKĐS - Mụn trứng cá, Đông y gọi là thanh xuân đậu, phần nhiều do lỗ chân lông bị nhiễm khuẩn gây ra. Ngoài ra, tuyến bã nhờn phân tiết quá thịnh cũng là một trong những nguyên nhân gây mụn...','http://suckhoedoisong.vn/5-bai-thuoc-tri-trung-ca-hieu-qua-n84555.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/_OLD/2014/cochehinhthanhmun-c60be.jpg',0,'BAITHUOC',0,'M','2016-10-14 04:51:16','5btttchq','SUCKHOE'),(1170567,'Bài thuốc trị đau đầu khi hành kinh','SKĐS - Đông y cho rằng: khi người phụ nữ đến kỳ kinh sinh chứng đau đầu, chảy máu mũi, buồn nôn... đó là những chứng bệnh thuộc cơ địa của mỗi người.','http://suckhoedoisong.vn/bai-thuoc-tri-dau-dau-khi-hanh-kinh-n122995.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/duylinh/2016/09/28/bai-thuoc-tri-dau-dau-khi-hanh-kinh1475035624.jpg',0,'BAITHUOC',0,'M','2016-10-14 04:51:16','Bttđđkhk','SUCKHOE'),(1170568,'7 cách tự nhiên làm sáng da “vùng kín”','SKĐS - Một số bài thuốc dân gian sau ngoài tác dụng làm sáng da vùng kín để bạn dễ dàng diện bikini còn giúp diệt khuẩn và chống nấm cho vùng kín.','http://suckhoedoisong.vn/7-cach-tu-nhien-lam-sang-da-vung-kin-n123059.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/bichvan/2016/09/29/7-cach-tu-nhien-lam-sang-da-vung-kin1475121122.jpg',0,'BAITHUOC',0,'M','2016-10-14 04:51:16','7ctnlsd“k','SUCKHOE'),(1170569,'Mua thuốc gia truyền trên mạng: Tiền mất, tật mang','SKĐS - Đánh trúng vào tâm lý có bệnh vái tứ phương và ngại đến bệnh viện khám bệnh của không ít người, thị trư