SD','Tỷ giá trung tâm được điều chỉnh giảm lần đầu trong bốn phiên trong khi giá USD tại một số ngân hàng thương...','http://bizlive.vn//vang-tien/ty-gia-trung-tam-quay-dau-giam-ngan-hang-dong-loat-tang-gia-usd-2079709.html','bizlive.vn','http://static.bizlive.vn/uploaded/thuytt/2016_10_14/vcb-2016-10-14_gstz.png?width=440&height=280&crop=auto&scale=both',0,'THITRUONGVANG',1,'HI','2016-10-14 04:51:33','TgttqđgnhđltgU','ECONOMY'),(1170849,'Stress đến quên cả chồng','(Dân trí) - Sau một thời gian dài stress, Marie Coe đã mắc chứng mất trí nhớ, quên mất chồng và tất cả người thân. Người phụ nữ thậm chí không thể nhớ được tuổi thơ cũng như tên của mình.','http://dantri.com.vn//chuyen-la/stress-den-quen-ca-chong-2016101407290348.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/photo-1-1476404637050.jpg',0,'GIOITINH',0,'M','2016-10-14 04:51:38','Sđqcc','TINHYEU'),(1170858,'Mỗi tháng Sáu về','(Dân trí) - Mỗi tháng Sáu về, lại giật mình thảng thốt bởi mốc nửa năm, nghĩa là đã nửa chặng đường, nửa chừng của kế hoạch, nửa chừng của dự định.','http://dantri.com.vn//tinh-yeu-gioi-tinh/moi-thang-sau-ve-20160603094000794.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/th6-1464921468750.jpg',0,'GOCTAMHON',0,'M','2016-10-14 04:51:40','MtSv','TINHYEU'),(1170859,'Niềm vui người nông dân lần đầu được đi chơi xa','Không chỉ tổ chức những lớp tập huấn kỹ thuật nông nghiệp, Đạm Cà Mau còn mong muốn mang lại những giá trị về mặt tinh thần cho bà con.','http://dantri.com.vn//goc-tam-hon/niem-vui-nguoi-nong-dan-lan-dau-duoc-di-choi-xa-20160812212752017.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/photo-1-1471011782588.jpg',0,'GOCTAMHON',0,'M','2016-10-14 04:51:40','Nvnndlđđđcx','TINHYEU'),(1170860,'Cảm ơn tháng Bảy','(Dân trí) - Tháng Bảy về, Quảng Trị lại trở thành niềm thương nỗi nhớ trong ký ức bao người. Có tự do đi giữa đất trời bình yên mà không xáo động hay giật mình thảng thốt bởi vài ám ảnh từ một dòng sông, một cây cầu hay nhiều địa danh lịch sử khác, mới hay giá trị của hòa bình.','http://dantri.com.vn//tinh-yeu-gioi-tinh/cam-on-thang-bay-20160713080521034.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/thachhan-1468371794648.jpg',0,'GOCTAMHON',0,'M','2016-10-14 04:51:40','CơtB','TINHYEU'),(1170861,'Nỗi niềm tháng Bảy','(Dân trí) - Tháng Bảy đến rồi sẽ lại đi, ngày tháng vẫn nối đuôi nhau dài rộng lắm. Dẫu vậy, vẫn cảm thấy vui vì ta đang sống những tháng năm tuổi trẻ, tuổi vẫn còn rất nhiều khao khát và ước mơ, tuổi của những đam mê chưa hề tắt lửa.','http://dantri.com.vn//tinh-yeu-gioi-tinh/noi-niem-thang-bay-20160717092008685.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/thangbay-1468720461908.png',0,'GOCTAMHON',0,'M','2016-10-14 04:51:40','NntB','TINHYEU'),(1170862,'Món quà của biển','(Dân trí) - Bão về, biển và trời xám xịt một màu, thuyền bè nối đuôi nhau tấp nập chạy vào lạch, những con chim báo bão bay rợp trời. Tôi và Cò vừa hạ cái cột ăng ten xuống thì trời nổi gió, từng hạt mưa lốp bốp đáp mái hiên. Rồi mưa, mưa xối xả trắng trời...','http://dantri.com.vn//tinh-yeu-gioi-tinh/mon-qua-cua-bien-20160723090552933.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/b6aded9f48/2016/07/17/anh-3-19918-1468716019027.JPG',0,'GOCTAMHON',0,'M','2016-10-14 04:51:40','Mqcb','TINHYEU'),(1170863,'Hạnh phúc hay không do mình cảm nhận','(Dân trí) - Đôi lúc bận lòng bởi nỗi thắc mắc của bạn, rằng thực ra hạnh phúc là gì và làm thế nào để giữ gìn ý niệm vốn mông lung này? Biết rằng đâu thể đong đếm hay định nghĩa chính xác khái niệm trừu tượng và đa nghĩa như hạnh phúc, như tình yêu.','http://dantri.com.vn//tinh-yeu-gioi-tinh/hanh-phuc-hay-khong-do-minh-cam-nhan-20160802101612409.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/hp-1470107608484.jpg',0,'GOCTAMHON',0,'M','2016-10-14 04:51:40','Hphkdmcn','TINHYEU'),(1170864,'Dẫu là ngày mưa bay','(Dân trí) - Bạn kể ngày xưa mỗi khi hò hẹn, hễ trời mưa người ta lại trì hoãn, lười biếng với cuộc gặp gỡ. Sau này, người sẵn sàng rời xa ngay lúc bạn đang loay hoay cùng cực. Mới hay bởi ngần ngại từ cơn mưa ngày trước nên lỡ bước dở dang một cuộc tình.','http://dantri.com.vn//tinh-yeu-gioi-tinh/dau-la-ngay-mua-bay-20160821083146477.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/ngaymua-1471742930245.jpg',0,'GOCTAMHON',0,'M','2016-10-14 04:51:40','Dlnmb','TINHYEU'),(1170865,'Thu trong lòng mình','(Dân trí) - Độ trước, khi trời chưa vào thu, lòng mình đã ngập ngụa lá rơi và nồng hoa sữa, hóa ra mùa thu ở trong tâm thức tự lúc nào, hệt như người đã trong tâm can bởi trót thương, trót nhớ, trót bận lòng.','http://dantri.com.vn//tinh-yeu-gioi-tinh/thu-trong-long-minh-20160910223350292.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/thu-trong-long-minh-2-hinh-internet-1473817842468.jpg',0,'GOCTAMHON',0,'M','2016-10-14 04:51:40','Ttlm','TINHYEU'),(1170866,'Cho đời bày cuộc vui','(Dân trí) - Thi thoảng, tôi lại thấy rối bời bởi ý nghĩ xã hội hiện đại sinh ra nhiều thứ thật tốt nhưng chưa hẳn đã lành. Nhiều người cắm cúi bằng lòng và chấp nhận sống với cuộc vui mà người khác bày biện sẵn.','http://dantri.com.vn//tinh-yeu-gioi-tinh/cho-doi-bay-cuoc-vui-20160922101659603.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/cho-doi-bay-cuoc-vui-2-hinh-internet-1474514022043.jpg',0,'GOCTAMHON',0,'M','2016-10-14 04:51:40','Cđbcv','TINHYEU'),(1170867,'Lần gặp cuối cùng','(Dân trí) - Tôi nghĩ rằng cái từ vô duyên nhất mà chúng ta thường nói đó là “giá như...”, nó giống như việc biết một ước mong không bao giờ còn có dịp thực hiện vẫn ước, một điều ước không bao giờ thành hiện thực. Giá như... biết trước sự đời thì đời đã không khổ.','http://dantri.com.vn//tinh-yeu-gioi-tinh/lan-gap-cuoi-cung-2016092721385959.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/cuoicung-1474987040943.png',0,'GOCTAMHON',0,'M','2016-10-14 04:51:40','Lgcc','TINHYEU'),(1170868,'Vị mùa gặt','(Dân trí) - \"Mẹ nhìn kìa, sao tối nay khói khắp nơi mà mùi khét thế này? Nhà nào cháy cái gì ấy?\", cậu con trai lớp Năm chạy từ ngoài ngõ vào, vẻ mặt rất nghiêm trọng thông báo.','http://dantri.com.vn//tinh-yeu-gioi-tinh/vi-mua-gat-20161005190255491.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/image1-1475668817587.jpg',0,'GOCTAMHON',0,'M','2016-10-14 04:51:40','Vmg','TINHYEU'),(1170869,'Những khoảnh khắc đẹp của ngày mùa','(Dân trí) - Về quê đúng vào vụ gặt, thỏa thích hít hà mùi thơm của lúa, hương nồng của rơm rạ. Cái mùi vị thân thương mà bao năm ở chốn thị thành vẫn không quên được. Lòng nao nao xúc động khi thấy áo cha ướt đẫm mồ hôi, chân mẹ lấm lem bùn đất, và mái tóc cháy vàng của thằng em tranh thủ ngày nghỉ học cùng cha mẹ ra đồng.','http://dantri.com.vn//tinh-yeu-gioi-tinh/nhung-khoanh-khac-dep-cua-ngay-mua-20161007092012531.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/photo-2-1475805826726.jpg',0,'GOCTAMHON',0,'M','2016-10-14 04:51:40','Nkkđcnm','TINHYEU'),(1170950,'Không chỉ là chuyện cá chết ','TTO - Hồ Tây được ví là lá phổi của Hà Nội. Mấy ngày nay, lá phổi này bị tổn thương khiến hàng chục tấn cá chết theo một cách oan uổng. Chuyện gì đang xảy ra trong lòng lá phổi rộng hàng trăm hecta này?','http://tuoitre.vn/tin/chinh-tri-xa-hoi/thoi-su-suy-nghi/20161005/khong-chi-la-chuyen-ca-chet/1182891.html','tuoitre.vn','http://static.new.tuoitre.vn/tto/i/s146/2016/10/05/cachet-1475630354.jpg',0,'THOISU',0,'HI','2016-10-14 04:51:46','Kclccc','TINTRONGNUOC'),(1170951,'Nuôi dưỡng niềm tin','TTO - Tuổi Trẻ ngày 5-10 đăng bài “Từ cuốn sổ của tổ lao công”, có bạn đọc chia sẻ “cuốn sổ ấy còn giá trị hơn giáo án dạy học được xây dựng công phu”. ','http://tuoitre.vn/tin/chinh-tri-xa-hoi/thoi-su-suy-nghi/20161006/nuoi-duong-niem-tin/1183432.html','tuoitre.vn','http://static.new.tuoitre.vn/tto/i/s146/2016/10/06/gv-1475635135-1475716590.jpg',0,'THOISU',0,'HI','2016-10-14 04:51:46','Ndnt','TINTRONGNUOC'),(1170952,'Phía sau nỗi đau  là điều tử tế','TT