ngôi nhà. Tuy nhiên, với phong cách sống ngày càng hiện đại thì việc khéo léo kết hợp màu đen với những tone màu khác sẽ giúp bạn “lột xác” phong cách cũ kỹ rất hiệu quả.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/nha-dep/phoi-mau-trang-den-tao-ve-dep-tinh-te-cho-noi-that.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/vananh/102016/10/23/thumbnail/231248baoxaydung_image001.jpg',0,'nhadep',0,'M','2016-10-14 15:13:55','Pmt-đtvđttcnt','xaydung'),(1171784,'Học cách thiết kế xa hoa, tinh xảo của người Pháp','Nếu là người yêu văn hóa Pháp thì bạn có thể thử thực hiện một số cách sau để khiến nội thất của mình mang hơi hướng phong cách Pháp.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/nha-dep/hoc-cach-thiet-ke-xa-hoa-tinh-xao-cua-nguoi-phap.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/vananh/102016/10/23/thumbnail/231940baoxaydung_24.jpg',0,'nhadep',0,'M','2016-10-14 15:13:55','HctkxhtxcnP','xaydung'),(1171785,'Lưu ý khi sắm nội thất gỗ làm đẹp căn hộ','Nội thất gỗ cần đồng bộ về màu sắc, hình dáng, sang trọng, vừa túi tiền, không nên sắm cận Tết vì đắt đỏ.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/nha-dep/luu-y-khi-sam-noi-that-go-lam-dep-can-ho.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/102016/11/14/thumbnail/141515baoxaydung_1.png',0,'nhadep',0,'M','2016-10-14 15:13:55','Lýksntglđch','xaydung'),(1171786,'Những bức tranh tường bằng gỗ mới lạ, độc đáo','(Xây dựng) - Những tác phẩm nghệ thuật trang trí treo tường thường được sử dụng phổ biến ở tất cả các không gian trong nhà như phòng khách, phòng ăn, phòng ngủ và cả phòng tắm. Bộ sưu tập dưới đây sẽ cung cấp cho bạn cái nhìn mới mẻ về những bức tranh treo tường bằng vật liệu vô cùng thân thuộc, gỗ.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/nha-dep/nhung-buc-tranh-tuong-bang-go-moi-la-doc-dao.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/102016/11/15/thumbnail/155808baoxaydung_1.jpg',0,'nhadep',0,'M','2016-10-14 15:13:55','Nbttbgmlđđ','xaydung'),(1171787,'Cách chọn màu sắc sàn gỗ','Việc lựa chọn màu sắc sàn gỗ như thế nào cho đẹp chính là vấn đề đã và đang được các gia chủ quan tâm hết mực. Tuy nhiên, có hàng trăm, hàng nghìn sự lựa chọn khác nhau, làm sao để đưa ra quyết định phù hợp với gu thẩm mỹ và phong cách đặc thù của ngôi nhà là chuyện vô cùng nan giải.','http://www.baoxaydung.com.vn/news/vn/quy-hoach-kien-truc/nha-dep/cach-chon-mau-sac-san-go.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/hiep/102016/11/20/thumbnail/201303baoxaydung_image002.jpg',0,'nhadep',0,'M','2016-10-14 15:13:55','Ccmssg','xaydung'),(1171794,'Thị trường BĐS TP.HCM: Nên đầu tư vào lĩnh vực nào?','(Xây dựng) - Từ cuối năm 2013, thị trường BĐS đã vượt qua giai đoạn khủng hoảng đóng băng, bắt đầu phục hồi và tăng trưởng. Cho đến nay trên tất cả các phân khúc thị trường BĐS đã có nhiều thương vụ lớn về mua bán chuyển nhượng dự án, sáp nhập DN thành công.','http://www.baoxaydung.com.vn/news/vn/bat-dong-san/thi-truong-bds-tphcm-nen-dau-tu-vao-linh-vuc-nao.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/nga/102016/13/10/thumbnail/105741baoxaydung_Thi_truong_BYS_TP_HCM_nen_dau_tu_vao_linh_vuc_nao.jpg',0,'batdongsan',0,'M','2016-10-14 15:13:59','TtBTNđtvlvn','xaydung'),(1171795,'VNREA - 15 năm đồng hành cùng thị trường BĐS Việt Nam','(Xây dựng) - Ngày 15/10, Hiệp hội Bất động sản Việt Nam (VNREA) chính thức tổ chức Đại hội lần thứ IV nhiệm kỳ (2016 - 2021), đánh dấu mốc son 15 năm đồng hành cùng cộng đồng DN trong nước và quốc tế hoạt động đầu tư kinh doanh BĐS tại Việt Nam.','http://www.baoxaydung.com.vn/news/vn/bat-dong-san/vnrea-15-nam-dong-hanh-cung-thi-truong-bds-viet-nam.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/nga/102016/13/10/thumbnail/101624baoxaydung_2.jpg',0,'batdongsan',0,'M','2016-10-14 15:13:59','V-1nđhcttBVN','xaydung'),(1171796,'Hơn cả một “chiếc cầu nối”!','(Xây dựng) - Ngày 15/10 tới, Hiệp hội BĐS Việt Nam sẽ tổ chức đại hội lần thứ IV tại Hà Nội với sự có mặt khoảng 800 đại biểu trên khắp cả nước.','http://www.baoxaydung.com.vn/news/vn/bat-dong-san/hon-ca-mot-chiec-cau-noi.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/nga/102016/13/14/thumbnail/145521baoxaydung_image001.jpg',0,'batdongsan',0,'M','2016-10-14 15:13:59','Hcm“cn','xaydung'),(1171797,'ParkCity Hanoi: Mở cửa tham quan nhà mẫu Evelyne','(Xây dựng) - ParkCity Hanoi mở cửa tham quan nhà mẫu Evelyne cho mọi khách hàng tới khu đô thị ParkCity Hanoi. Đặc biệt, cho tới hết ngày 30/11, ParkCity Hanoi dành ưu đãi đặc biệt cho đợt mở bán cuối cùng liền kề, biệt thự của tiểu khu Evelyne Gardens. Với chính sách ưu đãi “Mua trước, trả sau” và chiết khấu lên đến hàng trăm triệu đồng, khách hàng đã có thể sở hữu ngay một ngôi nhà trong công viên.','http://www.baoxaydung.com.vn/news/vn/bat-dong-san/parkcity-hanoi-mo-cua-tham-quan-nha-mau-evelyne.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/nga/102016/13/14/thumbnail/145738baoxaydung_A2.jpg',0,'batdongsan',0,'M','2016-10-14 15:13:59','PHMctqnmE','xaydung'),(1171798,'Ưu đãi hấp dẫn trong ngày mở bán căn hộ và biệt thự biển Phú Quốc','(Xây dựng) - Ngày 22&23/10, tại khách sạn Daewoo (360 Kim Mã, Ba Đình - Hà Nội) và tại khách sạn NewWorld (76 Lê Lai, Quận 01, TP. Hồ Chí Minh), hai sản phẩm nghỉ dưỡng đẳng cấp của Tập đoàn Sun Group, toà S4 với tầm nhìn trực diện biển thuộc dự án Condotel Premier Residences Phu Quoc Emerald Bay và những căn biệt thự nghỉ dưỡng sát biển độc đáo của dự án Premier Village Phu Quoc Resort sẽ được các đại lý phân phối chính thức mở bán.','http://www.baoxaydung.com.vn/news/vn/bat-dong-san/uu-dai-hap-dan-trong-ngay-mo-ban-can-ho-va-biet-thu-bien-phu-quoc.html','baoxaydung.com.vn','http://www.baoxaydung.com.vn/stores/news_dataimages/nga/102016/13/19/thumbnail/194742ba