25238.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/23/A-56ad5.jpg',0,'monnhat',0,'M','2016-10-14 15:15:05','BtnlvctnskN','nauancacnuoc'),(1172173,'Làm ngay món bánh Mizu Youkan để hiểu vì sao mọi người Nhật đều yêu thích!','Món bánh Mizu Youkan đậu đỏ này được bày bán khắp các siêu thị Nhật, có vị ngọt thanh, mềm mịn ăn vào tan trong miệng. Không mất nhiều thời gian mà chúng ta đã có món tráng miệng mang hương vị Nhật Bản chính hiệu rồi.','http://m.afamily.vn/lam-ngay-mon-banh-mizu-youkan-de-hieu-vi-sao-moi-nguoi-nhat-deu-yeu-thich-2016071610541642.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/07/12/A-8436b.jpg',0,'monnhat',0,'M','2016-10-14 15:15:05','LnmbMYđhvsmnNđyt','nauancacnuoc'),(1172174,'Mochi xoài - món bánh dẻo mềm ngon từ ngoài vào trong!','Với cách biến tấu làm mochi xoài này, bạn sẽ có một chiếc bánh xinh xắn với lớp vỏ bột nếp trắng tinh, mềm mại ôm trọn lấy viên xoài vàng ươm, ngọt dịu.','http://m.afamily.vn/mochi-xoai-mon-banh-deo-mem-ngon-tu-ngoai-vao-trong-20160625110031861.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/E88MOq9iOdccccccccccccjjVmV53G/Image/2016/06/mau/A-ab6e7.jpg',0,'monnhat',0,'M','2016-10-14 15:15:05','Mx-mbdmntnvt','nauancacnuoc'),(1172185,'Cơm chay kiểu Thái cho ngày rằm thanh tịnh','(Afamily.vn) Hương vị chua ngọt thơm lựng cùng màu sắc đẹp mắt của món cơm chay kiểu Thái sẽ cùng bạn chinh phục khẩu vị của cả nhà!','http://m.afamily.vn/an-ngon/com-chay-kieu-thai-cho-ngay-ram-thanh-tinh-2013031908027262.chn','afamily.vn','http://afamilycdn.com/zoom/160_100/Qalypm8xccccccccccccW2vZ1VroR/Image/2013/03/05/A-db72e.jpg',0,'monthai',0,'M','2016-10-14 15:15:06','CckTcnrtt','nauancacnuoc'),(1172186,'Canh gà kiểu Thái ấm lòng ngày mưa','Khi thời tiết chuyển mùa, những cơn mưa rào dai dẳng còn gì hoàn hảo hơn việc cùng cả gia đình quây quầy thưởng thức một tô canh gà kiểu Thái nóng ấm hấp dẫn!','http://m.afamily.vn/an-ngon/canh-g