ich đều đang liên hệ để sở hữu cầu thủ...','http://bongda24h.vn/bong-da-tbn/sao-tre-luxembourg-tiet-lo-duoc-real-va-bayern-theo-duoi-180-145539.html','bongda24h.vn','http://static.bongda24h.vn/medias/thumnail/2016/10/14/sao-tre-luxembourg-tiet-lo-duoc-real-va-bayern-theo-duoi.jpg',0,'BONGDA',0,'M','2016-10-14 15:15:20','StLtlđRvBtđ','SPORTNEWS'),(1172330,'Y học cổ truyền có chữa được bệnh ung thư không?','SKĐS - Đây là câu hỏi mà rất nhiều bạn đọc đã gửi đến báo Sức khỏe&Đời sống nhờ các chuyên gia giải đáp trong chương trình “Chữa bệnh theo phương pháp y học cổ truyền” diễn ra sáng ngày 7/10/2016.','http://suckhoedoisong.vn/y-hoc-co-truyen-co-chua-duoc-benh-ung-thu-khong-n123414.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/phamhiep/2016/10/07/y-hoc-co-truyen-co-chua-duoc-benh-ung-thu-khong1475828678.jpg',0,'YHOCCOTRUYEN',0,'M','2016-10-14 15:16:47','Yhctccđbutk','SUCKHOE'),(1172331,'Top 8 thảo dược nên ăn để ngăn ngừa suy giãn tĩnh mạch','SKĐS - Rau cải xoong, gừng, hay củ cải đường là các thực phẩm sửa chữa hư hỏng của protein trong thành mạch máu, giúp bạn ngăn ngừa suy giãn tĩnh mạch hữu hiệu. Đây là những loại thực phẩm tốt nhất để ăn, nếu bạn muốn ngăn ngừa chứng giãn tĩnh mạch.','http://suckhoedoisong.vn/top-8-thao-duoc-nen-an-de-ngan-ngua-suy-gian-tinh-mach-n123426.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/bichvan/2016/10/08/8-thuc-pham-tot-nhat-nen-an-de-ngan-ngua-suy-gian-tinh-mach1475900787.png',0,'YHOCCOTRUYEN',0,'M','2016-10-14 15:16:47','T8tdnăđnnsgtm','SUCKHOE'),(1172332,'Bài thuốc chữa ho do táo nhiệt','SKĐS - Ho do táo nhiệt y học cổ truyền gọi đàm nhiệt khái thấu. Nguyên nhân do khí trời táo nhiệt, lại gặp phải người vốn nhiệt tạng, đờm với nhiệt quấn quýt lấy nhau phát sinh bệnh.','http://suckhoedoisong.vn/bai-thuoc-chua-ho-do-tao-nhiet-n123459.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/nguyenkhanh/2016/10/09/bai-thuoc-chua-ho-do-tao-nhiet1476004647.jpg',0,'YHOCCOTRUYEN',0,'M','2016-10-14 15:16:47','Btchdtn','SUCKHOE'),(1172333,'Nhân ý dĩ - Vị thuốc bổ tỳ, lợi niệu, trị thấp','SKĐS - Nhân ý dĩ còn có tên bo bo, dĩ mễ, dĩ nhân, ý dĩ nhân. Tên khoa học: Coix lachryma-jobi L., họ lúa (Poaceae).','http://suckhoedoisong.vn/nhan-y-di-vi-thuoc-bo-ty-loi-nieu-tri-thap-n123506.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/duylinh/2016/10/10/nhan-y-di-vi-thuoc-bo-ty-loi-nieu-tri-thap1476074039.jpg',0,'YHOCCOTRUYEN',0,'M','2016-10-14 15:16:47','Nýd-Vtbtlntt','SUCKHOE'),(1172334,'Lợi ích sức khỏe không ngờ của thân cây chuối','SKĐS - Quả chuối và hoa chuối có nhiều lợi ích với sức khỏe. Nhưng ít người biết rằng thân cây chuối cũng là một bài thuốc tuyệt vời cho nhiều bệnh khác nhau như béo phì, sỏi thận, tiểu đường, táo bón, trào ngược axit….','http://suckhoedoisong.vn/loi-ich-suc-khoe-khong-ngo-cua-than-cay-chuoi-n123703.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_480x290/Images/hahien/2016/10/14/loi-ich-suc-khoe-khong-ngo-cua-than-cay-chuoi1476448258.jpg',0,'YHOCCOTRUYEN',0,'M','2016-10-14 15:16:47','Lískknctcc','SUCKHOE'),(1172341,'Những lợi ích của nghệ so với dược phẩm khác','SKĐS - Nghệ, gia vị chính trong món càri, được cho là một trong những thảo mộc mạnh trong viêc phòng chống bệnh.','http://suckhoedoisong.vn/nhung-loi-ich-cua-nghe-so-voi-duoc-pham-khac-n122984.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/nguyenkhanh/2016/09/28/nhung-loi-ich-cua-nghe-so-voi-duoc-pham-khac1475033441.jpg',0,'THUOCQUANHTA',0,'M','2016-10-14 15:16:48','Nlícnsvdpk','SUCKHOE'),(1172342,'Thảo dược giúp ngủ ngon','SKĐS - Theo quan niệm của YHCT, đối với người mất ngủ, dùng thuốc ngủ chỉ là trị phần ngọn, cần tìm ra nguyên nhân chính để trị tận gốc...','http://suckhoedoisong.vn/thao-duoc-giup-ngu-ngon-n84556.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/_OLD/2014/hat-sen-c60be.jpg',0,'THUOCQUANHTA',0,'M','2016-10-14 15:16:48','Tdgnn','SUCKHOE'),(1172343,'Công dụng tuyệt vời từ khoai lang','SKĐS - Khoai lang không chỉ có giá trị dinh dưỡng cao mà còn có những công dụng phòng chữa bệnh và là một trong những thực phẩm tạo miễn dịch tốt cho cơ thể','http://suckhoedoisong.vn/cong-dung-tuyet-voi-tu-khoai-lang-n23285.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/_OLD/2014/giam_can_bang_khoai_lang2-f7de2.jpg',0,'THUOCQUANHTA',0,'M','2016-10-14 15:16:48','Cdtvtkl','SUCKHOE'),(1172344,'Hương nhu tía - Vị thuốc giải cảm','Trong y học cổ truyền, hương nhu tía là vị thuốc chữa nhiều bệnh, đặc biệt là vị thuốc giải cảm khi bị lạnh hay đi mưa nhiễm lạnh rất hiệu quả.','http://suckhoedoisong.vn/huong-nhu-tia-vi-thuoc-giai-cam-n36541.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/_OLD/Images/Uploaded/Share/2010/10/12/970193.jpg',0,'THUOCQUANHTA',0,'M','2016-10-14 15:16:48','Hnt-Vtgc','SUCKHOE'),(1172345,'Chuối hột rừng món ăn  - bài thuốc nhiều công dụng','SKĐS-Cây chuối hột được dùng để chữa bệnh sỏi thận, đái tháo đường... Gần đây người ta lại ưa dùng chuối hột rừng hơn chuối hột nhà.','http://suckhoedoisong.vn/chuoi-hot-rung-mon-an-bai-thuoc-nhieu-cong-dung-n55773.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/_OLD/JRGSJiLd3e5GsxdM0P2pqg65KoKccc/Image/2012/11/Chuoi-hot-rung-mon-an-bai-thuoc-nhieu-cong-dung-757bb.jpg',0,'THUOCQUANHTA',0,'M','2016-10-14 15:16:48','Chrmă-btncd','SUCKHOE'),(1172355,'Ai không nên sử dụng nhung hươu?','SKĐS - Tuy được coi là một dược liệu quý nhưng không phải ai cũng dùng được nhung hươu.','http://suckhoedoisong.vn/ai-khong-nen-su-dung-nhung-huou-n83689.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/_OLD/2014/nhung-tuoi-2-b7637.jpg',0,'AMTHUC',0,'M','2016-10-14 15:16:50','Aknsdnh','SUCKHOE'),(1172356,'Mật ong vừa là thực phẩm vừa là thuốc','SKĐS - Trẻ em ăn mật ong sẽ hỗ trợ sự trưởng thành, phát dục và tăng cường thể chất tốt hơn. Người già ăn mật ong có thể làm chậm quá trình lão hóa và kéo dài tuổi thọ.','http://suckhoedoisong.vn/mat-ong-vua-la-thuc-pham-vua-la-thuoc-n83621.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/_OLD/2014/matong2-70d9c.jpg',0,'AMTHUC',0,'M','2016-10-14 15:16:50','Movltpvlt','SUCKHOE'),(1172357,'Món ăn - bài thuốc từ chim sẻ','SKĐS - Theo Đông y, thịt chim sẻ có vị ngọt, tính ấm; có tác dụng tráng dương ích tinh ôn kiện cân cốt, sáp niệu, chỉ khái suyễn.','http://suckhoedoisong.vn/mon-an-bai-thuoc-tu-chim-se-n83768.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/_OLD/2014/23-1-1410405880809.jpg',0,'AMTHUC',0,'M','2016-10-14 15:16:50','Mă-bttcs','SUCKHOE'),(1172358,'Chữa bệnh bằng rau cần nước','SKĐS - Rau cần nước còn gọi là cần cơm, cần ống, hương cần, hồ cần..., có tên khoa học là Oenanthe javanica (Blume), là một trong những loại rau thông dụng ở nước ta.','http://suckhoedoisong.vn/chua-benh-bang-rau-can-nuoc-n83815.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/_OLD/2014/1-rau-can-6036e-1390550666935-aa75b.jpg',0,'AMTHUC',0,'M','2016-10-14 15:16:50','Cbbrcn','SUCKHOE'),(1172359,'Biến hóa cùng rau đay','SKĐS - Chỉ cần ngắt một chút lá, vò ra, ta sẽ thấy hai tay rất trơn và nhớt. Chính tính nhớt này làm nên nét riêng của rau đay.','http://suckhoedoisong.vn/bien-hoa-cung-rau-day-n84071.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/_OLD/2014/rau-day-e808b.jpg',0,'AMTHUC',0,'M','2016-10-14 15:16:50','Bhcrđ','SUCKHOE'),(1172368,'7 thực phẩm chữa viêm loét dạ dày','SKĐS - Khi bị viêm loét dạ dày, bạn nên tránh hút thuốc, uống rượu, nên ăn thực phẩm giàu chất xơ và thực phẩm giàu flavonoid để nhanh hồi phục.','http://suckhoedoisong.vn/7-thuc-pham-chua-viem-loet-da-day-n123428.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/bichvan/2016/10/08/7-thuc-pham-chua-benh-loet-da-day1475904000.jpg',0,'DINHDUONG',0,'M','2016-10-14 15:16:52','7tpcvldd','SUCKHOE'),(1172369,'Thực phẩm cần tránh trong thực đơn của người viêm tụy','SKĐS - Viêm tụy có thể xảy ra do sỏi túi mật hay rượu bia, khiến bạn rất đau khi ăn. Khi bị viêm tụy, bạn cần kiêng dầu mỡ, tinh bột tinh chế, thịt béo và thực phẩm nhiều đường.','http://suckhoedoisong.vn/thuc-pham-can-tranh-trong-thuc-don-cua-nguoi-viem-tuy-n123427.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/bichvan/2016/10/08/thuc-pham-can-tranh-trong-thuc-don-cua-nguoi-viem-tuy1475902902.png',0,'DINHDUONG',0,'M','2016-10-14 15:16:52','Tpctttđcnvt','SUCKHOE'),(1172370,'Người bị viêm bàng quang nên kiêng ăn những thực phẩm nào?','SKĐS - Viêm bàng quang gây tiểu rắt và tiểu buốt. Khi bị viêm bàng quang, bạn nên kiêng đồ chua, đồ ướp muối và muối chua, sữa, đồ hộp, cà phê....','http://suckhoedoisong.vn/nguoi-bi-viem-bang-quang-nen-kieng-an-nhung-thuc-pham-nao-n123429.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/bichvan/2016/10/08/nguoi-bi-viem-bang-quang-nen-kieng-an-nhung-thuc-pham-nao1475909345.png',0,'DINHDUONG',0,'M','2016-10-14 15:16:52','Nbvbqnkăntpn','SUCKHOE'),(1172371,'Sau đột quỵ: Ăn gì là tốt?','SKĐS - Phòng ngừa tái phát đột quỵ là chiến lược tối ưu và lâu dài của bệnh nhân sau đột quỵ, bằng cách kiểm soát cân nặng, huyết áp và các yếu tố nguy cơ khác. Việc lựa chọn thực phẩm lành mạnh chính là một bước đi đúng hướng để tăng cường sức khỏe và hạn chế các nguy cơ sau đột quỵ.','http://suckhoedoisong.vn/sau-dot-quy-an-gi-la-tot-n123458.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/nguyenkhanh/2016/10/09/sau-dot-quy-an-gi-la-tot1476004374.jpg',0,'DINHDUONG',0,'M','2016-10-14 15:16:52','SđqĂglt','SUCKHOE'),(1172372,'Cà chua hỗ trợ giải độc cơ thể','SKĐS - Lycopen là sắc tố đỏ được tìm thấy trong nhiều loại trái cây và rau quả, đặc biệt dồi dào trong quả cà chua. Đây cũng là một chất chống ôxy hóa mạnh mẽ, cung cấp một loạt lợi ích sức khỏe như giúp bảo vệ cơ thể khỏi ung thư và có tác dụng giải độc.','http://suckhoedoisong.vn/ca-chua-ho-tro-giai-doc-co-the-n123483.html','suckhoedoisong.vn','http://suckhoedoisong.vn/thumb_160x100/Images/nguyenkhanh/2016/10/10/ca-chua-ho-tro-giai-doc-co-the1476067799.jpg',0,'DINHDUONG',0,'M','2016-10-14 15:16:52','Cchtgđct','SUCKHOE'),(1172378,'Nhờ 10 liệu pháp tự nhiên mà TS Mỹ cứu mẹ thoát khỏi ung thư một cách kỳ diệu','\"Lần đầu tiên mẹ mắc ung thư, tôi đang là một đứa trẻ, chưa biết chuyện gì. Nhưng 12 năm sau, là một chuyên gia dinh dưỡng nên tôi biết khả năng tự chữa bệnh của cơ thể\".','http://suckhoegiadinh.com.vn//khoe-+/nho-10-lieu-phap-tu-nhien-ma-ts-my-cuu-me-thoat-khoi-ung-thu-mot-cach-ky-dieu-22521/','suckhoegiadinh.com.vn','http://rs.suckhoegiadinh.com.vn/staticFile/Subject/2016/10/13/2221113/nho-10-lieu-phap-tu-nhien-ma-ts-my-cuu-me-thoat-khoi-ung-thu-mot-cach-ky-dieu1_131056669_13112126_200x113.jpg?w=180',0,'SUCKHOE',1,'M','2016-10-14 15:16:54','N1lptnmTMcmtkutmckd','SUCKHOE'),(1172379,'Tác dụng kỳ diệu của cây chùm ngây','(SKGĐ) Cây chùm ngây có tên khoa học là Moringa hay còn gọi là cây vạn năng có tác dụng giúp kích thích hoạt động của tim, phòng ngừa ung thư, loãng xương và tốt cho mắt…','http://suckhoegiadinh.com.vn//thuoc-va-suc-khoe/tac-dung-ky-dieu-cua-cay-chum-ngay-19394/','suckhoegiadinh.com.vn','http://rs.suckhoegiadinh.com.vn/staticFile/Subject/2015/10/01/2351714/cay-chum-ngay_1171662_200x113.jpg?w=180',0,'SUCKHOE',1,'M','2016-10-14 15:16:54','Tdkdcccn','SUCKHOE'),(1172380,'Dù khó khăn đến đâu, 4 con giáp sau cũng “gặp dữ hóa lành”','(SKGĐ) Những con giáp sau đây có thể biến hung thành cát nhờ hưởng phúc khí, được quý nhân phò trợ hoặc may mắn sở hữu nguồn năng lượng đặc biệt.','http://suckhoegiadinh.com.vn//song-tam-ly/du-kho-khan-den-dau-4-con-giap-sau-cung-gap-du-hoa-lanh-22224/','suckhoegiadinh.com.vn','http://rs.suckhoegiadinh.com.vn/staticFile/Subject/2016/08/09/2261710/con-giap-may-man_91711750_91711140_200x113.jpg?w=180',0,'SUCKHOE',1,'M','2016-10-14 15:16:54','Dkkđđ4cgsc“dhl','SUCKHOE'),(1172381,'Bị đuổi đi vì quá ít tiền, bà lão yêu cầu rút toàn bộ khiến cả ngân hàng sửng sốt','Một bà lão ăn mặc giản dị bước vào ngân hàng và xin rút 500 nghìn đồng nhưng bị mời ra khỏi ngân hàng. Tuy nhiên, hành động sau đó của bà khiến nhân viên kia phải cúi đầu xấu hổ.','http://suckhoegiadinh.com.vn//song-tam-ly/bi-duoi-di-vi-qua-it-tien-ba-lao-yeu-cau-rut-toan-bo-khien-ca-ngan-hang-sung-sot-22522/','suckhoegiadinh.com.vn','http://rs.suckhoegiadinh.com.vn/staticFile/Subject/2016/10/14/222105/bi-duoi-khoi-ngan-hang-vi-rut-qua-it-tien_14103108_14104174_200x113.jpg?w=180',0,'SUCKHOE',1,'M','2016-10-14 15:16:54','Bđđvqítblycrtbkcnhss','SUCKHOE'),(1172382,'Hãy gội đầu theo 5 cách truyền thống để tóc luôn khỏe và bóng mượt','(SKGĐ) Để có mái tóc chắc khỏe và bóng mượt, hãy thay thế các loại dầu gội bằng những loại quả, lá cây truyền thống.','http://suckhoegiadinh.com.vn//lam-dep/hay-goi-dau-theo-5-cach-truyen-thong-de-toc-luon-khoe-va-bong-muot-9568/','suckhoegiadinh.com.vn','http://rs.suckhoegiadinh.com.vn/staticFile/uploads/2014/06//goi-dau-truyen-thong_141010281_14101066_200x113.jpg?w=180',0,'SUCKHOE',1,'M','2016-10-14 15:16:54','Hgđt5cttđtlkvbm','SUCKHOE'),(1172393,'Danh sách thuốc bổ &quot;vô dụng&quot; và bổ thật do các chuyên gia Mĩ công bố','Hầu hết thuốc viên vitamin đều vô dụng, chỉ một số loại thực sự nên uống thôi. Đó là những thuốc gì?','http://m.afamily.vn/danh-sach-thuoc-bo-vo-dung-va-bo-that-do-cac-chuyen-gia-mi-cong-bo-2016101312155940.chn','afamily.vn','http://afamilycdn.com/thumb_in/200_150/AwWKf7rlu1Ckqz3Mr1sjw4gb51UN4/Image/2016/10/vavar-2d199.jpg',0,'SUCKHOE',0,'M','2016-10-14 15:16:56','Dstb&dvbtdccgMcb','SUCKHOE'),(1172394,'Cậu bé 7 tuổi may mắn khỏi bệnh vi khuẩn “ăn thịt người” nhờ thảo dược','Owen Richards, 7 tuổi, người Anh, bị mắc bệnh chàm thể nặng (eczema herpeticum) khiến da khô sần, sưng đỏ và ngứa tới nỗi cậu bé gãi cho tới khi chảy máu đầm đìa.','http://m.afamily.vn/cau-be-7-tuoi-may-man-khoi-benh-vi-khuan-an-thit-nguoi-nho-thao-duoc-20161013040634773.chn','afamily.vn','http://afamilycdn.com/thumb_in/500_210/AwWKf7rlu1Ckqz3Mr1sjw4gb51UN4/Image/2016/10/cx3-2f94e.jpg',0,'SUCKHOE',0,'M','2016-10-14 15:16:56','Cb7tmmkbvk“tnntd','SUCKHOE'),(1172395,'Thủ phạm khiến bạn vàng da, sụt cân, đau đớn vô cùng','Anh Nguyễn Văn Th. quê ở Yên Thành, Nghệ An vừa ôm bụng vừa nhăn nhó kể về hành trình hơn 4 tháng qua điều trị ở khắp các bệnh viện mà không tìm ra bệnh gì.','http://m.afamily.vn/thu-pham-khien-ban-vang-da-sut-can-dau-don-vo-cung-20161014100650394.chn','afamily.vn','http://afamilycdn.com/thumb_in/200_150/AwWKf7rlu1Ckqz3Mr1sjw4gb51UN4/Image/2016/10/savar-a21f2.jpg',0,'SUCKHOE',0,'M','2016-10-14 15:16:56','Tpkbvdscđđvc','SUCKHOE'),(1172396,'Những biến chứng đáng sợ khi sinh con ở tuổi vị thành niên','Việc chưa chuẩn bị gì cộng với việc chưa đủ hiểu biết dễ khiến trẻ mang thai sớm gặp biến chứng như thiếu máu, thai lưu, đẻ non, sảy thai. Đặc biệt là khi trẻ lâm bồn rất dễ bị băng huyết, nhiễm trùng, sản giật.','http://m.afamily.vn/nhung-bien-chung-dang-so-khi-sinh-con-o-tuoi-vi-thanh-nien-20161014111529723.chn','afamily.vn','http://afamilycdn.com/thumb_in/200_150/AwWKf7rlu1Ckqz3Mr1sjw4gb51UN4/Image/2016/10/tavar-a1310.jpg',0,'SUCKHOE',0,'M','2016-10-14 15:16:56','Nbcđskscởtvtn','SUCKHOE'),(1172397,'Coi chừng sỏi thận từ thói quen kết hợp đậu phụ với loại gia vị nhiều người rất thích này','Đậu phụ rẻ nhưng ngon và bổ, với điều kiện dùng đúng cách - không may là cách dùng rất quen thuộc của nhiều người lại không thuộc trong số này.','http://m.afamily.vn/coi-chung-soi-than-tu-thoi-quen-ket-hop-dau-phu-voi-loai-gia-vi-nhieu-nguoi-rat-thich-nay-20161014034445329.chn','afamily.vn','http://afamilycdn.com/thumb_in/200_150/yt9b5s6I1Bql6IJSJxWcw08XjC1Bbm/Image/2016/10/dauphutamhanh415-ccc40.jpg',0,'SUCKHOE',0,'M','2016-10-14 15:16:56','Ccstttqkhđpvlgvnnrtn','SUCKHOE'),(1172405,'6 ngộ nhận về ăn chay','(SKGĐ) Rất nhiều người coi ăn chay như một liệu pháp giảm cân và trị bệnh hiệu quả. Nhưng, ăn chay không thực sự tốt như mong muốn nếu bạn