i.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/20161006173529-unnamed-1476073895368.jpg',0,'GIADINH',0,'M','2016-10-14 15:17:10','Ncktphảncctf','TINHYEU'),(1172503,'Tôi đã cắt bỏ “khối u” ngoại tình','(Dân trí) - “Cô thử nhìn lại xem. Mười năm làm vợ cô đã làm được gì cho tôi. Cô có tư cách gì mà phê phán tôi này nọ”. Nghe anh nói xong tôi cũng hét lên: “Đúng, tôi là một kẻ ngu ngốc, ngu ngốc nên mới chung sống với anh cho đến tận bây giờ”.','http://dantri.com.vn//tinh-yeu-gioi-tinh/toi-da-cat-bo-khoi-u-ngoai-tinh-20161010153218308.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/voxau-1475123555055.png',0,'GIADINH',0,'M','2016-10-14 15:17:10','Tđcb“unt','TINHYEU'),(1172504,'Chồng đánh vợ để bênh bồ: Nỗi ê chề của... 3 người!','Thời gian gần đây liên tục xuất hiện những clip phụ nữ đánh ghen, nhưng lạ là khi hai người phụ nữ ẩu đả thì người đàn ông lại quay sang đánh vợ. Chúng tôi, gõ từ khóa “chồng đánh vợ để bênh bồ”, trên Google đã cho ra hàng loạt clip với những tình huống hết sức tréo ngoe.','http://dantri.com.vn//tinh-yeu-gioi-tinh/chong-danh-vo-de-benh-bo-noi-e-che-cua-3-nguoi-20161011070339907.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/chongdanhvodebenhbo1noiechecua3nguoi-1476144015907.jpg',0,'GIADINH',0,'M','2016-10-14 15:17:10','CđvđbbNêcc3n','TINHYEU'),(1172505,'Nhà trai bỏ chạy khỏi lễ ăn hỏi vì bị đòi phong bì 10 triệu','Gia đình nhà trai thấy bị phê bình thì nóng mắt. Ông bố chồng em đứng dậy cắt lời đại diện nhà gái và cho rằng, số tiền 10 triệu là quá lớn. Đặt số tiền đó không khác gì mua đứt em.','http://dantri.com.vn//tinh-yeu-gioi-tinh/nha-trai-bo-chay-khoi-le-an-hoi-vi-bi-doi-phong-bi-10-trieu-20161013145802391.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/20161008163927-co-dau1-1476345107867.jpg',0,'GIADINH',0,'M','2016-10-14 15:17:10','Ntbcklăhvbđpb1t','TINHYEU'),(1172506,'Vì sao có lừa dối trong hôn nhân?','Khảo sát xã hội học cho thấy nguyên nhân lớn nhất của ly hôn là sự thiếu trung thực và không có lòng tin ở nhau.','http://dantri.com.vn//tinh-yeu-gioi-tinh/vi-sao-co-lua-doi-trong-hon-nhan-20161013150717378.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/lua-doi-h3-qulh-1476345786828.jpg',0,'GIADINH',0,'M','2016-10-14 15:17:10','Vscldthn','TINHYEU'),(1172508,'Yêu xa','(Dân trí) - Nhiều người bảo em, thời đại này chẳng tin ai được, yêu gần còn chẳng ăn thua nữa là cách xa hàng nghìn cây số. Nhưng em vẫn tin, tình yêu thì chẳng quan trọng gì không gian hay giới hạn.','http://dantri.com.vn//tinh-yeu-gioi-tinh/yeu-xa-20161002070949139.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/yeuxa-1475366870407.png',0,'TINHYEU',0,'M','2016-10-14 15:17:12','Yx','TINHYEU'),(1172509,'Nhiều kinh nghiệm không làm hôn nhân hạnh phúc hơn','(Dân trí) - Đa phần mọi người tin rằng một khi có nhiều kinh nghiệm trong quá khứ, con người có thể làm tăng cơ hội hạnh phúc cho mình. Tuy nhiên, thực tế lại chứng minh điều hoàn toàn ngược lại.','http://dantri.com.vn//tinh-yeu-gioi-tinh/nhieu-kinh-nghiem-khong-lam-hon-nhan-hanh-phuc-hon-20161004091440363.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/photo-1-1475546633206.jpg',0,'TINHYEU',0,'M','2016-10-14 15:17:12','Nknklhnhph','TINHYEU'),(1172510,'Để dễ dàng quên đi người cũ','(Dân trí) - Kết thúc một mối tình là giai đoạn đau đớn, khó khăn. Với nhiều người, thời kì này còn trở nên dài vô tận khi bạn không thể ngừng suy nghĩ về người yêu cũ.','http://dantri.com.vn//tinh-yeu-gioi-tinh/de-de-dang-quen-di-nguoi-cu-20161005092253814.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/photo-1-1475634018080.jpg',0,'TINHYEU',0,'M','2016-10-14 15:17:12','Đddqđnc','TINHYEU'),(1172511,'Những khoảnh khắc rất ngọt của tình già','(Dân trí) - Nhiều khi các cặp đôi lớn tuổi biết cách yêu đương lãng mạn hơn cả thanh niên, còn con cháu lại phát thèm với những phút giây tình cảm của các cụ.','http://dantri.com.vn//tinh-yeu-gioi-tinh/nhung-khoanh-khac-rat-ngot-cua-tinh-gia-20161006070814391.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/photo-9-1475712228586.jpg',0,'TINHYEU',0,'M','2016-10-14 15:17:12','Nkkrnctg','TINHYEU'),(1172512,'“Yêu lại từ đầu” - có thể tặng em món quà này được không anh?','(Dân trí) - “Em yên tâm, sau này về chung một nhà, anh sẽ luôn coi em là bà hoàng để hầu hạ em.” Khi yêu thường ngốc lắm, nên em tin.','http://dantri.com.vn//tinh-yeu-gioi-tinh/yeu-lai-tu-dau-co-the-tang-em-mon-qua-nay-duoc-khong-anh-20161014122632453.htm','dantri.com.vn','https://dantri4.vcmedia.vn/zoom/130_100/2016/yeutudau-1476422674964.png',0,'TINHYEU',0,'M','2016-10-14 15:17:12','“ltđ-cttemqnđka','TINHYEU'),(1172523,'Về nhà bất chợt và phút nghe lén cuộc nói chuyện của bố mẹ chồng','Đúng lúc cô đang định dắt xe vào thì nghe tiếng bố mẹ chồng cô thủ thỉ: “Đúng là con dâu mình có 2 bằng đại học, nhưng rồi cũng chỉ là đứa bán hàng\".','http://m.afamily.vn/ve-nha-bat-chot-va-phut-nghe-len-cuoc-noi-chuyen-cua-bo-me-chong-20161012051148313.chn','afamily.vn','http://afamilycdn.com/thumb_in/300_225/8lP6agmT7oCb1HFncccccccccccc/Image/2016/10/ava1-14d65.jpg',0,'TINHYEU',0,'M','2016-10-14 15:17:12','Vnbcvpnlcnccbmc','TINHYEU'),(1172524,'Sự thật đằng sau dấu vết trinh trắng đêm tân hôn','hấy mẹ đang pha trà cho bố, anh hí hửng chạy nói nhó: “Mẹ nghe đồn ở đâu tiếng xấu về vợ con là không đúng đâu nhé! Cô ấy còn nguyên vẹn 100% ấy chứ!”.','http://m.afamily.vn/su-that-dang-sau-dau-vet-trinh-trang-dem-tan-hon-20161005053127637.chn','afamily.vn','http://afamilycdn.com/thumb_in/300_225/nSG4J1A5yX4lyU1miK12zJyWIGSnxC/Image/2016/08/dem-tan-hon-2b1a3.jpg',0,'TINHYEU',0,'M','2016-10-14 15:17:12','Stđsdvttđth','TINHYEU'),(1172525,'Từng mất niềm tin vào tình yêu, cô nàng xinh đẹp kể về cơ duyên kén được trai Tây đẹp như diễn viên lại chiều bạn gái','Trong lúc niềm tin sụp đổ vì bị bạn trai lừa dối, sự tình cờ của số phận đã khiến Thu Hương gặp được một nửa đích thực của cuộc đời: chàng trai Tây đẹp như diễn viên Hollywood cực chiều chuộng bạn gái.','http://m.afamily.vn/tung-mat-niem-tin-vao-tinh-yeu-co-nang-xinh-dep-ke-ve-co-duyen-ken-duoc-trai-tay-dep-nhu-dien-vien-lai-chieu-ban-gai-20161012054131897.chn','afamily.vn','http://afamilycdn.com/thumb_in/665_279/p9m6NOXZsrX7j1tWXItxbcynTO1UCB/Image/2016/10/yeu-trai-tay-x3-0ff33.jpg',0,'TINHYEU',0,'M','2016-10-14 15:17:12','TmntvtycnxđkvcdkđtTđndvlcbg','TINHYEU'),(1172526,'Rình bắt quả tang vợ ngoại tình chồng phát hiện bí mật bất ngờ','Thời gian này, Minh phát hiện ra vợ anh rất lạ. Cô ấy không chỉ đi làm về muộn mà còn lén lút thường xuyên ra ngoài buôn điện thoại giữa đêm khuya.','http://m.afamily.vn/rinh-bat-qua-tang-vo-ngoai-tinh-chong-phat-hien-bi-mat-bat-ngo-20161014041737554.chn','afamily.vn','http://afamilycdn.com/thumb_in/300_225/8lP6agmT7oCb1HFncccccccccccc/Image/2016/10/avacn-48ea7.jpg',0,'TINHYEU',0,'M','2016-10-14 15:17:12','Rbqtvntcphbmbn','TINHYEU'),(1172527,'Hai vợ chồng cùng nghiện, lén lút xem &quot;phim đen&quot; cho đến một ngày...','Tôi bắt đầu xem \"phim đen\" nhẹ nhàng khi mới 12 tuổi. Khi bố mẹ đã ngủ, tôi lẻn ra phòng khách để xem chương trình phim muộn trên Cinemax.','http://m.afamily.vn/hai-vo-chong-cung-nghien-len-lut-xem-phim-den-cho-den-mot-ngay-20161014095952266.chn','afamily.vn','http://afamilycdn.com/thumb_in/300_225/a3aS2T9Slycccccccccccc31ktSIL/Image/2016/10/nghienphimden_thumb-f447d.jpg',0,'TINHYEU',0,'M','2016-10-14 15:17:12','Hvccnllx&đcđmn','TINHYEU'),(1172537,'Giúp bé yêu ngủ ngon giấc','Giấc ngủ tốt sẽ giúp bé phát triển cả về thể chất và trí não. Mẹ hãy cùng tìm hiểu một số cách giúp bé yêu ngủ ngon dưới đây nhé.','http://m.afamily.vn/giup-be-yeu-ngu-ngon-giac-20161011094013283.chn','afamily.vn','http://afamilycdn.com/thumb_in/200_150/yrMSK0rZZPqGALan9lAcBKLuVQqo7/Image/2016/08/page-6790f.jpg',0,'mevabe',0,'M','2016-10-14 15:17:13','Gbynng','GIADINH'),(1172538,'Bé gái 3 tuổi bị vỡ thực quản chỉ vì hành động sai lầm của bà nội','Phát hiện đứa cháu gái 3 tuổi nuốt phải một đồng xu, bà nội đã vội vã sơ cứu nhưng sai cách khiến cháu bị vỡ thực quản.','http://m.afamily.vn/be-gai-3-tuoi-bi-vo-thuc-quan-chi-vi-hanh-dong-sai-lam-cua-ba-noi-20161011040046556.chn','afamily.vn','http://afamilycdn.com/thumb_in/500_210/yvacccccccccccc9hDf64MUSZaVDrY/Image/2016/10/be-gai-3-tuoi-vo-thuc-quan-vi-nguoi-lon-co-moc-dong-xu-ra-khoi-hong-be_6a12214502-50474.jpg',0,'mevabe',0,'M','2016-10-14 15:17:13','Bg3tbvtqcvhđslcbn','GIADINH'),(1172539,'Bố mẹ ép con nói 2 từ này, hại nhiều hơn lợi','Buộc trẻ thốt ra 2 tiếng “Xin lỗi” không chỉ dạy trẻ bài học sai lầm mà nó còn không thực sự giúp giải quyết vấn đề.','http://m.afamily.vn/bo-me-ep-con-noi-2-tu-nay-hai-nhieu-hon-loi-20161012015246205.chn','afamily.vn','http://afamilycdn.com/thumb_in/200_150/yvacccccccccccc9hDf64MUSZaVDrY/Image/2016/10/xin-loi-ava-5bf55.jpg',0,'mevabe',0,'M','2016-10-14 15:17:13','Bmécn2tnhnhl','GIADINH'),(1172540,'Cùng chơi trò chơi - cách tuyệt vời để con luôn khỏe mạnh','Con khỏe mạnh là niềm vui lớn nhất của cha mẹ nhưng giữ cho con khỏe mạnh lại không phải là việc mà cha mẹ có thể tự làm một mình. Hãy để con trở thành một \"chiến binh dũng cảm\" trong cuộc chiến vì sức khỏe này.','http://m.afamily.vn/cung-choi-tro-choi-cach-tuyet-voi-de-con-luon-khoe-manh-2016101209368630.chn','afamily.vn','http://afamilycdn.com/thumb_in/200_150/yrMSK0rZZPqGALan9lAcBKLuVQqo7/Image/2016/08/page-195d7.jpg',0,'mevabe',0,'M','2016-10-14 15:17:13','Cctc-ctvđclkm','GIADINH'),(1172541,'&quot;Hoa khôi nhí&quot; Tây Nguyên gây xôn xao cộng đồng mạng những ngày qua là ai?','Ngắm nhìn những bức ảnh với vẻ đẹp tự nhiên đầy cuốn hút của cô bé 4 tuổi đến từ Buôn Ma Thuột, cư dân mạng đã không ngần ngại gọi em là \"hoa khôi nhí\" đất Tây Nguyên.','http://m.afamily.vn/hot-kid.htm','afamily.vn','http://afamilycdn.com/thumb_in/500_210/yvacccccccccccc9hDf64MUSZaVDrY/Image/2016/10/kha-au1-ba4c7.jpg',0,'mevabe',0,'M','2016-10-14 15:17:13','&knTNgxxcđmnnqla','GIADINH'),(1172552,'Người Thái phủ phục trên vỉa hè chờ đón di hài Quốc vương','','http://