t VN (ĐSVN) cho biết mưa lũ do áp thấp nhiệt đới gây ra ở miền Trung đã khiến tuyến đường sắt Bắc Nam đoạn qua Quảng Bình bị ách tắc hoàn toàn. Đến tối 14-10, có 22 đoàn tàu nằm chờ.','http://tuoitre.vn/tin/chinh-tri-xa-hoi/20161014/mua-lu-lam-duong-sat-bac-nam-ach-tac-22-doan-tau-nam-cho/1188373.html','tuoitre.vn','http://static.new.tuoitre.vn/tto/i/s490/2016/10/14/duong-sat-1476453778.jpg',0,'CHINHTRIXAHOI',1,'M','2016-10-14 15:17:16','MllđsBNát2đtnc','TINTRONGNUOC'),(1172562,'Ngỡ ngàng với đảo chôn rác Semakau của Singapore','TTO - Thảm cỏ xanh, bông giấy đỏ rực, rặng dừa mướt mát và san sát các trại nuôi tôm, cá… Đó là những gì đập vào mắt du khách khi tới đảo Semakau, bãi chôn rác duy nhất còn hoạt động của Singapore.','http://tuoitre.vn/tin/the-gioi/20161009/ngo-ngang-voi-dao-chon-rac-semakau-cua-singapore/1185190.html','tuoitre.vn','http://static.new.tuoitre.vn/tto/i/s146/2016/10/09/4ea9d455.jpg',0,'MOITRUONG',0,'HI','2016-10-14 15:17:17','NnvđcrScS','TINTRONGNUOC'),(1172563,'Bình Thuận không cho dự án titan dùng nước ngầm','TTO - Tỉnh Bình Thuận không cho sử dụng nước ngầm để khai thác titan mà dành nguồn nước này để phục vụ dân sinh.','http://tuoitre.vn/tin/chinh-tri-xa-hoi/20161009/binh-thuan-khong-cho-du-an-titan-dung-nuoc-ngam/1185349.html','tuoitre.vn','http://static.new.tuoitre.vn/tto/i/s146/2016/10/09/titanbinhthuan9-10-1476006096.jpg',0,'MOITRUONG',0,'HI','2016-10-14 15:17:17','BTkcdátdnn','TINTRONGNUOC'),(1172564,'​Hà Nội lắp 4 hệ thống cấp khí oxy hòa tan ở Hồ Tây','TTO - Chủ tịch UBND TP Hà Nội Nguyễn Đức Chung cho biết Hà Nội đã lắp đặt 4 hệ thống cấp khí oxy hòa tan công suất lớn, hiệu suất cao nhằm bổ sung khẩn cấp khí oxy hòa tan cho Hồ Tây.','http://tuoitre.vn/tin/chinh-tri-xa-hoi/20161009/ha-noi-lap-4-he-thong-cap-khi-oxy-hoa-tan-o-ho-tay/1185403.html','tuoitre.vn','http://static.new.tuoitre.vn/tto/i/s146/2016/10/02/ca-chet-ho-tay-10-jpg-1475383247.jpg',0,'MOITRUONG',0,'HI','2016-10-14 15:17:17','​Nl4htckohtởHT','TINTRONGNUOC'),(1172565,